","created_at":"2016-12-01 04:27:25 UTC","updated_at":"2016-12-01 04:27:25 UTC","archived":null,"plan_id":1742,"archived_by":null},{"id":218,"user_id":4401,"question_id":1,"text":"","created_at":"2016-12-01 05:46:47 UTC","updated_at":"2016-12-01 05:46:47 UTC","archived":null,"plan_id":4162,"archived_by":null},{"id":219,"user_id":4405,"question_id":8,"text":"","created_at":"2016-12-01 17:51:17 UTC","updated_at":"2016-12-01 17:51:17 UTC","archived":null,"plan_id":4165,"archived_by":null},{"id":220,"user_id":4408,"question_id":194,"text":"","created_at":"2016-12-01 18:47:47 UTC","updated_at":"2016-12-01 18:47:47 UTC","archived":null,"plan_id":4169,"archived_by":null},{"id":221,"user_id":4408,"question_id":196,"text":"","created_at":"2016-12-01 18:47:47 UTC","updated_at":"2016-12-01 18:47:47 UTC","archived":null,"plan_id":4169,"archived_by":null},{"id":222,"user_id":4312,"question_id":202,"text":"","created_at":"2016-12-01 18:56:42 UTC","updated_at":"2016-12-01 18:56:42 UTC","archived":null,"plan_id":4062,"archived_by":null},{"id":223,"user_id":4411,"question_id":20,"text":"","created_at":"2016-12-05 22:06:39 UTC","updated_at":"2016-12-05 22:06:39 UTC","archived":null,"plan_id":4187,"archived_by":null},{"id":224,"user_id":4412,"question_id":202,"text":"","created_at":"2016-12-05 22:23:43 UTC","updated_at":"2016-12-05 22:23:43 UTC","archived":null,"plan_id":4188,"archived_by":null},{"id":225,"user_id":4415,"question_id":196,"text":"","created_at":"2016-12-06 01:16:54 UTC","updated_at":"2016-12-06 01:16:54 UTC","archived":null,"plan_id":4188,"archived_by":null},{"id":226,"user_id":4427,"question_id":20,"text":"","created_at":"2016-12-08 05:49:42 UTC","updated_at":"2016-12-08 05:49:42 UTC","archived":null,"plan_id":4195,"archived_by":null},{"id":227,"user_id":4427,"question_id":21,"text":"","created_at":"2016-12-08 05:57:28 UTC","updated_at":"2016-12-08 05:57:28 UTC","archived":null,"plan_id":4195,"archived_by":null},{"id":228,"user_id":4427,"question_id":21,"text":"","created_at":"2016-12-08 06:03:38 UTC","updated_at":"2016-12-08 06:03:38 UTC","archived":null,"plan_id":4195,"archived_by":null},{"id":229,"user_id":4427,"question_id":20,"text":"","created_at":"2016-12-08 06:04:47 UTC","updated_at":"2016-12-08 06:04:47 UTC","archived":null,"plan_id":4195,"archived_by":null},{"id":230,"user_id":4427,"question_id":20,"text":"","created_at":"2016-12-08 07:23:44 UTC","updated_at":"2016-12-08 07:23:44 UTC","archived":null,"plan_id":4195,"archived_by":null},{"id":231,"user_id":4427,"question_id":4,"text":"","created_at":"2016-12-08 07:25:43 UTC","updated_at":"2016-12-08 07:25:43 UTC","archived":null,"plan_id":4195,"archived_by":null},{"id":232,"user_id":4312,"question_id":196,"text":"","created_at":"2016-12-12 15:52:46 UTC","updated_at":"2016-12-12 15:52:46 UTC","archived":null,"plan_id":4062,"archived_by":null},{"id":233,"user_id":4325,"question_id":11,"text":"","created_at":"2016-12-12 20:56:09 UTC","updated_at":"2016-12-12 20:56:09 UTC","archived":null,"plan_id":4198,"archived_by":null},{"id":234,"user_id":4325,"question_id":8,"text":"","created_at":"2016-12-12 20:56:20 UTC","updated_at":"2016-12-12 20:56:20 UTC","archived":null,"plan_id":4198,"archived_by":null},{"id":235,"user_id":4312,"question_id":196,"text":"","created_at":"2016-12-14 20:52:15 UTC","updated_at":"2016-12-14 20:52:15 UTC","archived":null,"plan_id":4062,"archived_by":null},{"id":236,"user_id":4408,"question_id":196,"text":"","created_at":"2016-12-16 14:46:51 UTC","updated_at":"2016-12-16 14:46:51 UTC","archived":null,"plan_id":4169,"archived_by":null},{"id":237,"user_id":4383,"question_id":194,"text":"<p>Marie : Il serait utile d'avoir un dictionnaire ou lexique ou un guide pour savoir quelles sont les d&eacute;finitions des diff&eacute;rentes types de donn&eacute;es, notamment celles donn&eacute;es en exemple.</p>","created_at":"2016-12-18 17:18:58 UTC","updated_at":"2016-12-18 17:18:58 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":238,"user_id":4383,"question_id":194,"text":"<p>Marie : C&ocirc;t&eacute; ergonomique, il serait bien d'avoir une plus grande fen&ecirc;tre de r&eacute;ponse pour faciliter le travail. L'utilisateur devrait pouvoir voir toute sa r&eacute;ponse.<br /><br />Aussi, il faudrait que l'enregistrement soit automatique (comme Google doc, par exemple), ou du moins qu'on puisse sauvegarder une annotation ind&eacute;pendamment d'une r&eacute;ponse. Je viens de perdre ma r&eacute;ponse en enregistrant mon annotation.</p>","created_at":"2016-12-18 17:27:24 UTC","updated_at":"2016-12-18 17:27:24 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":239,"user_id":4383,"question_id":195,"text":"<p>Encore une fois, un petit guide produit par l'UQAM serait utile. Par exemple, les bases de donn&eacute;es peuvent &ecirc;tre sauvegard&eacute;es dans tel tel et tel format, mais tel format est pr&eacute;f&eacute;rable pour telle raison. Les fichiers vid&eacute;os peuvent &ecirc;tre sauvegard&eacute; dans tel tel tel format, mais tel format est pr&eacute;f&eacute;rable pour X raison.<br /><br />Les liens fournis sont quand m&ecirc;me bien utiles &agrave; ce sujet, l'UQAM pourrait s'en inspirer.</p>","created_at":"2016-12-18 17:33:28 UTC","updated_at":"2016-12-18 19:50:05 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":240,"user_id":4383,"question_id":196,"text":"<p>Encore une fois, le document fourni par UBC est utile, surtout pour justifier les pratiques. L'UQAM devrait s'en inspirer pour produire un tel guide.</p>","created_at":"2016-12-18 17:51:26 UTC","updated_at":"2016-12-18 19:51:03 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":241,"user_id":4383,"question_id":197,"text":"<p>Difficile de savoir quel niveau de pr&eacute;cision est requis ou demand&eacute; ici. l'UQAM pourrait produire un guide des bonnes pratiques, offrir des exemples, ou des \"templates\".</p>","created_at":"2016-12-18 18:05:53 UTC","updated_at":"2016-12-18 19:54:04 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":242,"user_id":4383,"question_id":198,"text":"<p>Un exemple plus concret serait utile pour cette question. L'UQAM pourrait fournir cela.</p>","created_at":"2016-12-18 18:12:09 UTC","updated_at":"2016-12-18 19:55:06 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":243,"user_id":4383,"question_id":202,"text":"<p>Un exemple serait fort utile. Comment une autre &eacute;quipe comme la n&ocirc;tre a-t-elle fait?</p>","created_at":"2016-12-18 18:30:35 UTC","updated_at":"2016-12-18 18:30:35 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":244,"user_id":4383,"question_id":204,"text":"<p>Encore une fois, un exemple de r&eacute;ponse serait grandement utile. L'UQAM pourrait pr&eacute;parer cela, ou du moins d&eacute;construire en &eacute;tapes recommand&eacute;es/ communes le processus.</p>\r\n<p>Les informations sur l'anonymisation fournies par le UK Data Archive sont tr&egrave;s int&eacute;ressantes. Elles devraient &ecirc;tre fournies aux auxiliaire de recherche - id&eacute;alement l'UQAM les auraient traduites :)</p>","created_at":"2016-12-18 21:23:53 UTC","updated_at":"2016-12-18 21:30:22 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":245,"user_id":4383,"question_id":204,"text":"<p>Une seconde r&eacute;vision des verbatims risque d'&ecirc;tre tr&egrave;s co&ucirc;teuse. Comment l'&eacute;viter, sans perdre des informations pertinentes pour l'analyse?</p>","created_at":"2016-12-18 21:27:24 UTC","updated_at":"2016-12-18 21:27:24 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":246,"user_id":4383,"question_id":206,"text":"<p>&nbsp;Les directives pour cette question incluent des liens qui m&egrave;nent &agrave; une tr&egrave;s grande quantit&eacute; d'information. Ce qui est super, si on a le temps de tout lire.<br />L'UQAM pourrait identifier les licences communes pour chaque discipline, de plus que d'indiquer les coordonn&eacute;es de la personne ressource &agrave; ce sujet.</p>","created_at":"2016-12-18 21:44:53 UTC","updated_at":"2016-12-18 21:44:53 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":247,"user_id":4383,"question_id":206,"text":"<p>&nbsp;Ce que je comprends, c'est que les licences peuvent permettre diff&eacute;rents niveaux d'accessibilit&eacute;. Voir :</p>\r\n<p>https://creativecommons.org/choose/</p>\r\n<p>Donc quel niveau est requis par le CRSH? Acces complet?</p>","created_at":"2016-12-18 21:46:58 UTC","updated_at":"2016-12-18 21:46:58 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":248,"user_id":4383,"question_id":207,"text":"<p>L'UQAM pourrait fournir des exemples plus concretes. <br />Je n'ai pas lu les liens dans les directives (manque de temps).</p>","created_at":"2016-12-18 21:47:52 UTC","updated_at":"2016-12-18 21:51:08 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":249,"user_id":4383,"question_id":208,"text":"<p>L'UQAM devrait fournir une liste des formations offertes qui pourraient &ecirc;tre utiles aux gens responsables, ainsi que des livres ou autres formes d'instructions disponibles &agrave; la biblioth&egrave;que (p.ex. vid&eacute;os).<br />Les coordonn&eacute;es de la personne responsable devrait aussi &ecirc;tre inscrite ici.</p>","created_at":"2016-12-18 22:00:56 UTC","updated_at":"2016-12-18 22:00:56 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":250,"user_id":4383,"question_id":209,"text":"<p>Que signifie : \"le d&eacute;partement ou la division qui supervise cette recherche en assumera la responsabilit&eacute;\" (voir directives)? Dans le cas du changement du directeur de projet, ou dans d'autres cas?</p>","created_at":"2016-12-18 22:06:01 UTC","updated_at":"2016-12-18 22:06:01 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":251,"user_id":4383,"question_id":209,"text":"<p>L'UQAM pourrait fournir un exemple concret de \"processus &agrave; suivre\" dans le cas du changement de direction ou de personnel important &agrave; la gestion des donn&eacute;es.</p>","created_at":"2016-12-18 22:08:42 UTC","updated_at":"2016-12-18 22:08:42 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":252,"user_id":4383,"question_id":210,"text":"<p>Il faut voir si CRSH explicite le soutient qu'ils vont fournir &agrave; la PGD (voir directives).</p>\r\n<p>L'UQAM pourrait fournir une liste des d&eacute;penses &agrave; pr&eacute;voir plus d&eacute;taill&eacute;e (p.ex. qu'est-ce que les prestations d'acc&egrave;s) et aussi une id&eacute;e des prix pour chaque &eacute;l&eacute;ment, afin de justement faciliter la pr&eacute;paration d'un budget r&eacute;aliste.</p>","created_at":"2016-12-18 22:16:42 UTC","updated_at":"2016-12-18 22:16:42 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":253,"user_id":4383,"question_id":213,"text":"<p>L'UQAM devrait fournir les coordonn&eacute;es des personnes et services &agrave; l'UQAM qui peuvent aider &agrave; r&eacute;pondre aux questions.</p>","created_at":"2016-12-18 23:17:28 UTC","updated_at":"2016-12-18 23:17:28 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":254,"user_id":4383,"question_id":212,"text":"<p>L'UQAM pourrait fournir des informations similaires &agrave; celles fournies par le UK Data Archive dans cette section.</p>","created_at":"2016-12-18 23:19:21 UTC","updated_at":"2016-12-18 23:19:21 UTC","archived":null,"plan_id":4138,"archived_by":null},{"id":255,"user_id":4312,"question_id":207,"text":"","created_at":"2016-12-19 20:09:10 UTC","updated_at":"2016-12-19 20:09:10 UTC","archived":null,"plan_id":4062,"archived_by":null},{"id":256,"user_id":4352,"question_id":210,"text":"","created_at":"2016-12-20 23:04:34 UTC","updated_at":"2016-12-20 23:04:34 UTC","archived":null,"plan_id":4122,"archived_by":null},{"id":257,"user_id":4443,"question_id":213,"text":"","created_at":"2017-01-04 18:05:14 UTC","updated_at":"2017-01-04 18:05:14 UTC","archived":null,"plan_id":4220,"archived_by":null},{"id":258,"user_id":4371,"question_id":202,"text":"","created_at":"2017