this part</p>","created_at":"2017-01-09 15:56:09 UTC","updated_at":"2017-01-09 15:56:09 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":270,"user_id":4402,"question_id":197,"text":"<p>Not sure about this</p>","created_at":"2017-01-09 16:07:55 UTC","updated_at":"2017-01-09 16:07:55 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":271,"user_id":4316,"question_id":202,"text":"","created_at":"2017-01-09 16:10:48 UTC","updated_at":"2017-01-09 16:10:48 UTC","archived":null,"plan_id":4069,"archived_by":null},{"id":272,"user_id":4402,"question_id":198,"text":"<p>??????</p>","created_at":"2017-01-09 16:12:27 UTC","updated_at":"2017-01-09 16:12:27 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":273,"user_id":4402,"question_id":203,"text":"","created_at":"2017-01-09 18:02:39 UTC","updated_at":"2017-01-09 18:02:39 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":274,"user_id":4402,"question_id":204,"text":"","created_at":"2017-01-09 18:02:40 UTC","updated_at":"2017-01-09 18:02:40 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":275,"user_id":3453,"question_id":202,"text":"<p>why?</p>","created_at":"2017-01-10 14:53:38 UTC","updated_at":"2017-01-10 14:53:38 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":276,"user_id":4402,"question_id":208,"text":"","created_at":"2017-01-12 13:34:42 UTC","updated_at":"2017-01-12 13:34:42 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":277,"user_id":4402,"question_id":209,"text":"","created_at":"2017-01-12 13:34:42 UTC","updated_at":"2017-01-12 13:34:42 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":278,"user_id":4402,"question_id":210,"text":"","created_at":"2017-01-12 13:34:42 UTC","updated_at":"2017-01-12 13:34:42 UTC","archived":null,"plan_id":4020,"archived_by":null},{"id":279,"user_id":4473,"question_id":258,"text":"","created_at":"2017-01-13 21:50:11 UTC","updated_at":"2017-01-13 21:50:11 UTC","archived":null,"plan_id":4250,"archived_by":null},{"id":280,"user_id":4473,"question_id":272,"text":"","created_at":"2017-01-13 22:50:54 UTC","updated_at":"2017-01-13 22:50:54 UTC","archived":null,"plan_id":4250,"archived_by":null},{"id":281,"user_id":4476,"question_id":199,"text":"","created_at":"2017-01-16 22:36:49 UTC","updated_at":"2017-01-16 22:36:49 UTC","archived":null,"plan_id":4253,"archived_by":null},{"id":282,"user_id":2996,"question_id":196,"text":"<p>Le Service des archives et de gestion des documents de l&rsquo;UQAM offre une formation intitul&eacute;e &laquo;&nbsp;Bonne pratiques de gestion des documents num&eacute;riques&nbsp;&raquo; qui traite entre autre de cet aspect.</p>","created_at":"2017-01-20 19:17:50 UTC","updated_at":"2017-02-01 21:03:07 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":283,"user_id":2996,"question_id":195,"text":"<p>Sugg&eacute;rer des ressources en fran&ccedil;ais lorsqu'elles existent. Par exemple : BNF. Format de donn&eacute;es pour la pr&eacute;servation num&eacute;rique. <a href=\"http://www.bnf.fr/fr/professionnels/preservation_numerique_boite_outils/a.pres_num_formats.html\" target=\"_blank\">http://www.bnf.fr/fr/professionnels/preservation_numerique_boite_outils/a.pres_num_formats.html</a></p>","created_at":"2017-01-23 14:32:03 UTC","updated_at":"2017-01-27 18:53:36 UTC","archived":1,"plan_id":4275,"archived_by":2996},{"id":284,"user_id":2996,"question_id":200,"text":"<p>Quelle est la porte d'entr&eacute;e pour obtenir de l'aide: Aide pour les besoins de stockage et aide pour mettre en place l&rsquo;infrastructure n&eacute;cessaire &agrave; un projet de recherche?</p>","created_at":"2017-01-23 14:42:13 UTC","updated_at":"2017-02-01 21:10:17 UTC","archived":1,"plan_id":4275,"archived_by":2996},{"id":285,"user_id":2996,"question_id":201,"text":"<p>Les Services informatiques (lien/courriel?) pourront vous aider &agrave; mettre en place l&rsquo;infrastructure n&eacute;cessaire &agrave; un projet de recherche</p>\r\n<p>Ils pourront vous assiter dans l'&eacute;laboration de votre strat&eacute;gie de sauvegarde (back up)?</p>","created_at":"2017-01-23 14:43:43 UTC","updated_at":"2017-02-01 21:23:48 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":286,"user_id":2996,"question_id":202,"text":"<p>Les Services informatiques (lien/courriel?) pourront vous aider &agrave; mettre au point les strat&eacute;gies de collaboration et de s&eacute;curit&eacute; entre les diff&eacute;rents espaces de travail?</p>","created_at":"2017-01-23 14:45:22 UTC","updated_at":"2017-02-01 21:24:47 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":287,"user_id":2996,"question_id":203,"text":"<p>Le biblioth&eacute;caire associ&eacute; &agrave; votre d&eacute;partement pourra vous aider &agrave; identifier les d&eacute;p&ocirc;ts pertinents pour vos donn&eacute;es: <a href=\"http://www.bibliotheques.uqam.ca/bibliothecaires-disciplines\" target=\"_blank\">http://www.bibliotheques.uqam.ca/bibliothecaires-disciplines</a></p>","created_at":"2017-01-23 14:48:11 UTC","updated_at":"2017-02-01 21:30:08 UTC","archived":1,"plan_id":4275,"archived_by":2996},{"id":288,"user_id":2996,"question_id":204,"text":"<p>Expertise du Service des archives et de gestion des documents de l&rsquo;UQAM pour les formats de fichiers. Les biblioth&egrave;ques sont en mesure de d&eacute;velopper un expertise.</p>\r\n<p>BNF dit que UK est la r&eacute;f&eacute;rence.</p>","created_at":"2017-01-23 14:49:04 UTC","updated_at":"2017-01-23 14:55:37 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":289,"user_id":2996,"question_id":205,"text":"<p>Les directives font r&eacute;f&eacute;rence &agrave; des exigences institutionnelles...</p>","created_at":"2017-01-23 14:57:05 UTC","updated_at":"2017-01-23 15:04:32 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":290,"user_id":2996,"question_id":210,"text":"<p>Est-ce qu'un agent de recherche peut assister les chercheur pour le budget?</p>","created_at":"2017-01-23 15:09:33 UTC","updated_at":"2017-02-01 21:30:48 UTC","archived":1,"plan_id":4275,"archived_by":2996},{"id":291,"user_id":2996,"question_id":213,"text":"<p>Ressources de l'UQAM :&nbsp; Comit&eacute; d'&eacute;thique de la recherche de l&rsquo;UQAM et Service des affaires juridiques</p>","created_at":"2017-01-23 15:10:44 UTC","updated_at":"2017-01-23 15:10:44 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":292,"user_id":2996,"question_id":212,"text":"<p>Les comit&eacute;s d'&eacute;thique de la recherche de l&rsquo;UQAM devraient &ecirc;tre sensibilis&eacute;s &agrave; cette question puisqu'il faut obtenir le consentement des participants avant la collecte des donn&eacute;es.</p>","created_at":"2017-01-23 15:13:05 UTC","updated_at":"2017-01-23 15:13:05 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":293,"user_id":3932,"question_id":194,"text":"<p>test</p>","created_at":"2017-01-24 16:44:23 UTC","updated_at":"2017-01-24 16:45:24 UTC","archived":1,"plan_id":4275,"archived_by":3932},{"id":294,"user_id":194,"question_id":202,"text":"","created_at":"2017-01-26 01:50:08 UTC","updated_at":"2017-01-26 01:50:08 UTC","archived":null,"plan_id":4284,"archived_by":null},{"id":295,"user_id":194,"question_id":200,"text":"<p>Suivant la version 13 de la norme du Conseil canadien de pataphysique. Gaston, peux-tu v&eacute;rifier?</p>","created_at":"2017-01-26 01:52:48 UTC","updated_at":"2017-01-26 01:52:48 UTC","archived":null,"plan_id":4284,"archived_by":null},{"id":296,"user_id":2996,"question_id":195,"text":"<p>Des directives UQAM proposeraient des ressources en fran&ccedil;ais lorsqu'elles existent. Par exemple : BNF. Format de donn&eacute;es pour la pr&eacute;servation num&eacute;rique. <a href=\"http://www.bnf.fr/fr/professionnels/preservation_numerique_boite_outils/a.pres_num_formats.html\" target=\"_blank\">http://www.bnf.fr/fr/professionnels/preservation_numerique_boite_outils/a.pres_num_formats.html</a></p>","created_at":"2017-01-27 18:54:29 UTC","updated_at":"2017-01-27 18:54:29 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":297,"user_id":2996,"question_id":195,"text":"<p>Ressource en fran&ccedil;ais:</p>\r\n<p>BNF. Format de donn&eacute;es pour la pr&eacute;servation num&eacute;rique. <a href=\"http://www.bnf.fr/fr/professionnels/preservation_numerique_boite_outils/a.pres_num_formats.html\" target=\"_blank\">http://www.bnf.fr/fr/professionnels/preservation_numerique_boite_outils/a.pres_num_formats.html</a></p>","created_at":"2017-02-01 19:29:12 UTC","updated_at":"2017-02-01 19:29:12 UTC","archived":null,"plan_id":4304,"archived_by":null},{"id":298,"user_id":2996,"question_id":196,"text":"<p>Le Service des archives et de gestion des documents de l&rsquo;UQAM offre une formation intitul&eacute;e &laquo;&nbsp;Bonne pratiques de gestion des documents num&eacute;riques&nbsp;&raquo; qui couvre le contenu de cette question.</p>","created_at":"2017-02-01 19:30:04 UTC","updated_at":"2017-02-01 19:30:04 UTC","archived":null,"plan_id":4304,"archived_by":null},{"id":299,"user_id":4527,"question_id":194,"text":"","created_at":"2017-02-01 19:48:19 UTC","updated_at":"2017-02-01 19:48:19 UTC","archived":null,"plan_id":4305,"archived_by":null},{"id":300,"user_id":2996,"question_id":194,"text":"<p>Le biblioth&eacute;caire associ&eacute; &agrave; votre d&eacute;partement peut vous aider &agrave; rep&eacute;rer des donn&eacute;es dans votre domaine de recherche.</p>\r\n<p>Pour les donn&eacute;es statistiques&nbsp;:<a href=\"http://guides.bibliotheques.uqam.ca/themes/82-Donnees-statistiques\" target=\"_blank\">http://guides.bibliotheques.uqam.ca/themes/82-Donnees-statistiques</a></p>","created_at":"2017-02-01 21:01:12 UTC","updated_at":"2017-02-01 21:01:12 UTC","archived":null,"plan_id":4275,"archived_by":null},{"id":301,"user_id":2996,"question_id":212,"text":"<p>Pour le consentement des participants&nbsp;: Comit&eacute; institutionnel d&rsquo;&eacute;thique de la recherche avec des &ecirc;tres humains (CIEREH) / Comit&eacute; d&