675,"user_id":5288,"question_id":258,"text":"","created_at":"2017-11-10 19:28:06 UTC","updated_at":"2017-11-10 19:28:06 UTC","archived":null,"plan_id":5256,"archived_by":null},{"id":676,"user_id":5279,"question_id":275,"text":"","created_at":"2017-11-10 19:36:06 UTC","updated_at":"2017-11-10 19:36:06 UTC","archived":null,"plan_id":5256,"archived_by":null},{"id":677,"user_id":4386,"question_id":199,"text":"","created_at":"2017-11-10 19:39:51 UTC","updated_at":"2017-11-10 19:39:51 UTC","archived":null,"plan_id":4538,"archived_by":null},{"id":678,"user_id":5296,"question_id":199,"text":"","created_at":"2017-11-13 01:51:44 UTC","updated_at":"2017-11-13 01:51:44 UTC","archived":null,"plan_id":5265,"archived_by":null},{"id":679,"user_id":5269,"question_id":197,"text":"<p>We need to think about this one.&nbsp; Perhaps we could create some sort of cover note to go with the data.</p>","created_at":"2017-11-17 14:59:28 UTC","updated_at":"2017-11-17 14:59:28 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":680,"user_id":5269,"question_id":199,"text":"<p>Trina -- this is your thing!&nbsp;</p>","created_at":"2017-11-17 15:00:45 UTC","updated_at":"2017-11-17 15:00:45 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":681,"user_id":5269,"question_id":198,"text":"<p>I'm not sure how to answer this.</p>","created_at":"2017-11-17 15:01:14 UTC","updated_at":"2017-11-17 15:01:14 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":682,"user_id":5269,"question_id":201,"text":"<p>Right now, it's on Google Drive only and I have a sync copy on my hard drive.&nbsp; We're thinking about putting everything somewhere else; I can't remember where.</p>","created_at":"2017-11-17 15:03:07 UTC","updated_at":"2017-11-17 15:03:07 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":683,"user_id":5269,"question_id":202,"text":"<p>I suppose this new place where we'll be storing our data will be permanent?</p>","created_at":"2017-11-17 15:04:19 UTC","updated_at":"2017-11-17 15:04:19 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":684,"user_id":5269,"question_id":203,"text":"<p>Will this new storage support long-term perservation and access?</p>","created_at":"2017-11-17 15:05:09 UTC","updated_at":"2017-11-17 15:05:09 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":685,"user_id":5269,"question_id":205,"text":"<p>We should think about this a bit more.&nbsp; I don't think I have any issue with making our journals and transcripts available as long as we scrub them of personal information.&nbsp; What do you think?</p>","created_at":"2017-11-17 15:07:02 UTC","updated_at":"2017-11-17 15:07:02 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":686,"user_id":5269,"question_id":206,"text":"<p>Interesting!&nbsp; I'm thinking no need for any end user licence but I don't really know anything about it.</p>","created_at":"2017-11-17 15:08:20 UTC","updated_at":"2017-11-17 15:08:20 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":687,"user_id":5269,"question_id":207,"text":"<p>I'm not sure</p>","created_at":"2017-11-17 15:09:11 UTC","updated_at":"2017-11-17 15:09:11 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":688,"user_id":5269,"question_id":209,"text":"<p>hmmm...</p>","created_at":"2017-11-17 15:10:48 UTC","updated_at":"2017-11-17 15:10:48 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":689,"user_id":5269,"question_id":210,"text":"<p>I'm assuming whatever we use for storage will be free.&nbsp;&nbsp;</p>","created_at":"2017-11-17 15:11:51 UTC","updated_at":"2017-11-17 15:11:51 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":690,"user_id":5269,"question_id":211,"text":"<p>This depends on where we're going to keep our data.</p>","created_at":"2017-11-17 15:12:32 UTC","updated_at":"2017-11-17 15:12:32 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":691,"user_id":5269,"question_id":201,"text":"<p>I just remember what it is!&nbsp; Dataverse on Scholar Portal.&nbsp; I've created an account.&nbsp; It's probably best to store our data under Ryerson because most likely that you'll still be with Ryerson after I'm done with UofT.</p>","created_at":"2017-11-17 15:18:10 UTC","updated_at":"2017-11-17 15:18:10 UTC","archived":null,"plan_id":5245,"archived_by":null},{"id":692,"user_id":5303,"question_id":199,"text":"","created_at":"2017-11-17 21:41:04 UTC","updated_at":"2017-11-17 21:41:04 UTC","archived":null,"plan_id":5269,"archived_by":null},{"id":693,"user_id":5296,"question_id":210,"text":"","created_at":"2017-11-17 22:31:01 UTC","updated_at":"2017-11-17 22:31:01 UTC","archived":null,"plan_id":5265,"archived_by":null},{"id":694,"user_id":5296,"question_id":202,"text":"","created_at":"2017-11-17 23:02:15 UTC","updated_at":"2017-11-17 23:02:15 UTC","archived":null,"plan_id":5265,"archived_by":null},{"id":695,"user_id":5297,"question_id":200,"text":"","created_at":"2017-11-19 01:45:16 UTC","updated_at":"2017-11-19 01:45:16 UTC","archived":null,"plan_id":5266,"archived_by":null},{"id":696,"user_id":5297,"question_id":200,"text":"","created_at":"2017-11-19 02:02:39 UTC","updated_at":"2017-11-19 02:02:39 UTC","archived":null,"plan_id":5266,"archived_by":null},{"id":697,"user_id":5305,"question_id":258,"text":"","created_at":"2017-11-19 17:50:35 UTC","updated_at":"2017-11-19 17:50:35 UTC","archived":null,"plan_id":5280,"archived_by":null},{"id":698,"user_id":5305,"question_id":259,"text":"","created_at":"2017-11-19 17:50:35 UTC","updated_at":"2017-11-19 17:50:35 UTC","archived":null,"plan_id":5280,"archived_by":null},{"id":699,"user_id":5305,"question_id":260,"text":"","created_at":"2017-11-19 17:50:35 UTC","updated_at":"2017-11-19 17:50:35 UTC","archived":null,"plan_id":5280,"archived_by":null},{"id":700,"user_id":5297,"question_id":208,"text":"","created_at":"2017-11-19 20:46:07 UTC","updated_at":"2017-11-19 20:46:07 UTC","archived":null,"plan_id":5266,"archived_by":null},{"id":701,"user_id":5314,"question