ll,"plan_id":5611,"archived_by":null},{"id":847,"user_id":5635,"question_id":196,"text":"","created_at":"2018-03-17 18:37:23 UTC","updated_at":"2018-03-17 18:37:23 UTC","archived":null,"plan_id":5644,"archived_by":null},{"id":848,"user_id":5636,"question_id":210,"text":"","created_at":"2018-03-17 18:50:04 UTC","updated_at":"2018-03-17 18:50:04 UTC","archived":null,"plan_id":5643,"archived_by":null},{"id":849,"user_id":5632,"question_id":196,"text":"","created_at":"2018-03-18 14:35:49 UTC","updated_at":"2018-03-18 15:08:23 UTC","archived":1,"plan_id":5641,"archived_by":5632},{"id":850,"user_id":5632,"question_id":195,"text":"<p>Source: https://www.unidata.ucar.edu/software/netcdf/docs/netcdf_introduction.html</p>\r\n<p>Source:&nbsp;https://en.wikipedia.org/wiki/NetCDF The Net CDF format is an&nbsp;<a href=\"https://en.wikipedia.org/wiki/Open_standard\" target=\"_blank\">open standard</a>. NetCDF Classic and 64-bit Offset Format are an international standard of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Open_Geospatial_Consortium\" target=\"_blank\">Open Geospatial Consortium</a>.<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/NetCDF#cite_note-2\" target=\"_blank\">[2]</a></sup></p>","created_at":"2018-03-18 14:49:53 UTC","updated_at":"2018-03-18 14:49:53 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":851,"user_id":5632,"question_id":195,"text":"<p>Advise Open Science Framework for long-term re-use?</p>\r\n<p>Add info from FAIR Guiding Principles with respect to long-term care of data. Supporting discovery through good data management.&nbsp;</p>","created_at":"2018-03-18 15:03:24 UTC","updated_at":"2018-03-18 16:01:33 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":852,"user_id":5632,"question_id":196,"text":"","created_at":"2018-03-18 15:05:45 UTC","updated_at":"2018-03-18 15:07:43 UTC","archived":1,"plan_id":5641,"archived_by":5632},{"id":853,"user_id":5632,"question_id":194,"text":"<p>As overarching theme:&nbsp;Add info from FAIR Guiding Principles with respect to&nbsp;long-term&nbsp;care of data. Findability; Accessiblity, Interoperability, and Resuability. Supporting discovery through good data management. Source: nature.com/scientificdata DOI: 0.1038/sdata.2016.18</p>","created_at":"2018-03-18 16:08:22 UTC","updated_at":"2018-03-18 16:08:22 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":854,"user_id":5632,"question_id":196,"text":"<p>Use SQL to map folder structure/to model data? How do we ensure version control? OSF allows for version control.</p>","created_at":"2018-03-18 18:59:37 UTC","updated_at":"2018-03-18 18:59:37 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":855,"user_id":5632,"question_id":208,"text":"<p>For definitions of data steward vs data owner: <a href=\"https://bit.ly/2GmRd8B\" target=\"_blank\">https://bit.ly/2GmRd8B</a></p>\r\n<p><a href=\"https://www.techopedia.com/definition/29059/data-ownership\" target=\"_blank\">https://www.techopedia.com/definition/29059/data-ownership</a></p>","created_at":"2018-03-25 14:26:20 UTC","updated_at":"2018-03-25 14:26:20 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":856,"user_id":5673,"question_id":197,"text":"","created_at":"2018-03-26 18:34:18 UTC","updated_at":"2018-03-26 18:34:18 UTC","archived":null,"plan_id":5692,"archived_by":null},{"id":857,"user_id":5673,"question_id":197,"text":"","created_at":"2018-03-26 18:34:18 UTC","updated_at":"2018-03-26 18:34:18 UTC","archived":null,"plan_id":5692,"archived_by":null},{"id":858,"user_id":5673,"question_id":198,"text":"","created_at":"2018-03-26 18:34:19 UTC","updated_at":"2018-03-26 18:34:19 UTC","archived":null,"plan_id":5692,"archived_by":null},{"id":859,"user_id":5673,"question_id":198,"text":"","created_at":"2018-03-26 18:34:19 UTC","updated_at":"2018-03-26 18:34:19 UTC","archived":null,"plan_id":5692,"archived_by":null},{"id":860,"user_id":5673,"question_id":199,"text":"","created_at":"2018-03-26 18:34:22 UTC","updated_at":"2018-03-26 18:34:22 UTC","archived":null,"plan_id":5692,"archived_by":null},{"id":861,"user_id":5673,"question_id":199,"text":"","created_at":"2018-03-26 18:34:22 UTC","updated_at":"2018-03-26 18:34:22 UTC","archived":null,"plan_id":5692,"archived_by":null},{"id":862,"user_id":5632,"question_id":196,"text":"<p>Sensor Data<br />Data Collector type:&nbsp;<br />&nbsp;e.g. ROMV&nbsp;<br />Data format:<br />NetCDF (contains all files of this type from all sensors)<br />Data Type: Field Notes<br />Animal type?<br />Subfolders: Captured and tagged animals, mark and recapture populations estimations, class-based observations studies<br />Citizen scientist reports</p>","created_at":"2018-03-26 19:14:17 UTC","updated_at":"2018-03-30 14:43:41 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":863,"user_id":5632,"question_id":206,"text":"<p>I asked a question in the discussion forum about data ownership, and the response has more to do with licensing:&nbsp;</p>\r\n<p>\"I have never bothered to get specific licenses. After your request I took a look for the citizen scientists and my own contract. Their data is open data and I own the data I produce.<br />There is not procedure or contract in place that the students (incoming or leaving) have to sign. Do you think that it is necessary to have that written down somewhere?\"</p>","created_at":"2018-03-26 19:17:58 UTC","updated_at":"2018-03-26 19:17:58 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":864,"user_id":5632,"question_id":196,"text":"","created_at":"2018-03-26 21:36:54 UTC","updated_at":"2018-03-26 21:36:54 UTC","archived":null,"plan_id":5641,"archived_by":null},{"id":865,"user_id":5681,"question_id":194,"text":"<p>Hello world</p>","created_at":"2018-03-29 16:35:24 UTC","updated_at":"2018-03-29 16:35:24 UTC","archived":null,"plan_id":5702,"archived_by":null},{"id":866,"user_id":5632,"question_id":204,"text":"","created_at":"2018-03-30 18:22:55 UTC","updated_at":"2018-03-30 18