 UTC","updated_at":"2018-04-11 18:31:50 UTC","archived":null,"plan_id":5752,"archived_by":null},{"id":889,"user_id":5724,"question_id":194,"text":"<p>Field variables for numeric and text are those which relate to prospective students and applicants to undergraduate studies. Due to requirement to be FIPPA compliant the data are cleansed/anonymized.</p>","created_at":"2018-04-11 18:35:45 UTC","updated_at":"2018-04-11 18:35:45 UTC","archived":null,"plan_id":5755,"archived_by":null},{"id":890,"user_id":5733,"question_id":196,"text":"","created_at":"2018-04-11 18:46:02 UTC","updated_at":"2018-04-11 18:46:02 UTC","archived":null,"plan_id":5747,"archived_by":null},{"id":891,"user_id":5743,"question_id":194,"text":"","created_at":"2018-04-13 20:29:30 UTC","updated_at":"2018-04-13 20:29:30 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":892,"user_id":5743,"question_id":196,"text":"","created_at":"2018-04-13 20:29:32 UTC","updated_at":"2018-04-13 20:29:32 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":893,"user_id":5743,"question_id":197,"text":"","created_at":"2018-04-13 20:32:57 UTC","updated_at":"2018-04-13 20:32:57 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":894,"user_id":5743,"question_id":198,"text":"","created_at":"2018-04-13 20:32:57 UTC","updated_at":"2018-04-13 20:32:57 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":895,"user_id":5743,"question_id":199,"text":"","created_at":"2018-04-13 20:32:57 UTC","updated_at":"2018-04-13 20:32:57 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":896,"user_id":5748,"question_id":197,"text":"","created_at":"2018-04-13 20:33:49 UTC","updated_at":"2018-04-13 20:33:49 UTC","archived":null,"plan_id":5765,"archived_by":null},{"id":897,"user_id":5743,"question_id":200,"text":"","created_at":"2018-04-13 20:34:17 UTC","updated_at":"2018-04-13 20:34:17 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":898,"user_id":5743,"question_id":201,"text":"","created_at":"2018-04-13 20:34:17 UTC","updated_at":"2018-04-13 20:34:17 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":899,"user_id":5743,"question_id":202,"text":"","created_at":"2018-04-13 20:34:17 UTC","updated_at":"2018-04-13 20:34:17 UTC","archived":null,"plan_id":5760,"archived_by":null},{"id":900,"user_id":5400,"question_id":196,"text":"","created_at":"2018-04-19 19:38:03 UTC","updated_at":"2018-04-19 19:38:03 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":901,"user_id":5691,"question_id":194,"text":"","created_at":"2018-04-23 21:05:31 UTC","updated_at":"2018-04-23 21:05:31 UTC","archived":null,"plan_id":5712,"archived_by":null},{"id":902,"user_id":5691,"question_id":196,"text":"","created_at":"2018-04-23 21:05:31 UTC","updated_at":"2018-04-23 21:05:31 UTC","archived":null,"plan_id":5712,"archived_by":null},{"id":903,"user_id":251,"question_id":194,"text":"<p>Can you please add your response from the activity?</p>\r\n<p>Air samples at Gordon Southam Observatory will be collected continuously from air intakes located at the four towers (North, South, East and West)</p>","created_at":"2018-04-24 20:57:58 UTC","updated_at":"2018-04-24 21:04:45 UTC","archived":1,"plan_id":5422,"archived_by":251},{"id":904,"user_id":251,"question_id":195,"text":"","created_at":"2018-04-24 20:57:59 UTC","updated_at":"2018-04-24 20:57:59 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":905,"user_id":251,"question_id":196,"text":"","created_at":"2018-04-24 20:57:59 UTC","updated_at":"2018-04-24 23:33:16 UTC","archived":1,"plan_id":5422,"archived_by":251},{"id":906,"user_id":251,"question_id":195,"text":"","created_at":"2018-04-24 20:57:59 UTC","updated_at":"2018-04-24 20:57:59 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":907,"user_id":251,"question_id":194,"text":"","created_at":"2018-04-24 21:05:10 UTC","updated_at":"2018-04-24 21:05:10 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":908,"user_id":251,"question_id":211,"text":"<p>X and third party copyright will be protected. The PI will be responsible for ensuring that all project members are aware as to the ownership of data and who may access them and under what conditions. Online access to the data will be password protected.</p>","created_at":"2018-04-24 21:12:21 UTC","updated_at":"2018-04-24 21:12:21 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":909,"user_id":251,"question_id":208,"text":"<p>The project will assign a qualified data manager certified in disclosure risk management to act as steward for the data while they are being collected, processed, and analyzed</p>","created_at":"2018-04-24 21:13:11 UTC","updated_at":"2018-04-24 21:13:11 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":910,"user_id":251,"question_id":205,"text":"<p>Data will be available and cited in publication. Researchers will be able to contact the PI for access to data. Data will be maintained in an open XML format to enable open re-use of the data</p>","created_at":"2018-04-24 21:13:41 UTC","updated_at":"2018-04-24 21:13:41 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":911,"user_id":251,"question_id":203,"text":"<p>By depositing data with (pending) Dataverse North, our project will ensure that the research data are migrated to new formats, platforms, and storage media as required by good practice.\"</p>","created_at":"2018-04-24 21:14:07 UTC","updated_at":"2018-04-24 21:14:07 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":912,"user_id":251,"question_id":200,"text":"<p>The data files from this study will be managed, processed, and stored in a secure environment (e.g., lockable computer systems with passwords, firewall system in place, power surge protection, virus/malicious intruder protection) and by controlling access to digital files with encryption and/or password protection.</p>","created_at":"2018-04-24 21:14:35 UTC","updated_at":"2018-04-24 21:14:35 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":913,"user_id":251,"question_id":197,"text":"<p>The clinical data collected from this project will be documented using DDI metadata standards</p>","created_at":"2018-04-24 21:15:43 UTC","updated_at":"2018-04-24 21:15:43 UTC","archived":null,"plan_id":5422,"archived_by":null},{"id":914,"user_id":5770,"question_id":194,"text":"<p>quantitatives provenant de fichier d'enregistrement SPSS</p>\r\n<p>&nbsp;</p>","created_at":"2018-04-26 18:26:33 UTC","updated_at":"2018-04-26 18:26:33 UTC","archived":null,"plan_id":5790,"archived_by":null},{"id":915,"user_id":5770,"question_id":194,"text":"<p>donn&eacute;es num&eacute;riques &eacute;quivalent &agrave; \"quantitatives\" et non pas &agrave; \"digital\"</p>","created_at":"2018-04-26 19:34:43 UTC","updated_at":"2018-04-26 19:34:43 UTC","archived":null,"plan_id":5790,"archived_by":null},{"id":916,"user_id":5770,"question_id":210,"text":"","created_at":"2018-04-26 19:55:59 UTC","updated_at":"2018-04-26 19:55:59 UTC","archived":null,"plan_id":5790,"archived_by":null},{"id":917,"user_id":4506,"question_id":196,"text":"<p>You should specify your date format convention. The best (really the only) way to go is YYYY-MM-DD. Dashes are a valid character in a file name, and using this convention will mean that if you sort your files alphabetically on your computer they will be in chronologiacal order</p>","created_at":"2018-04-30 15:44:40 UTC","updated_at":"2018-04-30 15:44:40 UTC","archived":null,"plan_id":5784,"archived_by":null},{"id":918,"user_id":5517,"question_id":194,"text":"","created_at":"2018-05-01 23:22:12 UTC","updated_at":"2018-05-01 23:22:12 UTC","archived":null,"plan_id":5490,"archived_by":null},{"id":919,"user_id":5517,"question_id":197,"text":"","created_at":"2018-05-01 23:30:25 UTC","updated_at":"2018-05-01 23:30:25 UTC","archived":null,"plan_id":5490,"archived_by":null},{"id":920,"user_id":5517,"question_id":205,"text":"","created_at":"2018-05-01 23:39:31 UTC","updated_at":"2018-05-01 23:39:31 UTC","archived":null,"plan_id":5490,"archived_by":null},{"id":921,"user_id":5778,"question_id":20,"text":"","created_at":"2018-05-04 16:53:34 UTC","updated_at":"2018-05-04 16:53:34 UTC","archived":null,"plan_id":5805,"archived_by":null},{"id":922,"user_id":5794,"question_id":20,"text":"<p>Do we have a system for archiving old files? For example, the P-PAG folder has several folders of old content that is no longer relevant to our current group, and includes several documents of older versions of now finalized documents.&nbsp;</p>","created_at":"2018-05-10 16:23:28 UTC","updated_at":"2018-05-10 16:23:28 UTC","archived":null,"plan_id":5805,"archived_by":null},{"id":923,"user_id":5794,"question_id":4,"text":"<p>Which naming convention is the most up to date one?&nbsp;</p>\r\n<p>[NameofFile]_[Author]_[DayMonthYear]_[DraftVersion#]_[InitialsofPersonModifyingText].ext</p>\r\n<p>TITLE\"_DDMMMYY_INITIALS&nbsp;</p>","created_at":"2018-05-10 16:27:10 UTC","updated_at":"2018-06-14 20:54:02 UTC","archived":1,"plan_id":5805,"archived_by":5794},{"id":924,"user_id":5794,"question_id":9,"text":"<p>Is this an appropriate statement?&nbsp;</p>","created_at":"2018-05-10 16:42:00 UTC","updated_at":"2018-05-10 16:42:00 UTC","archived":null,"plan_id":5805,"archived_by":null},{"id":925,"user_id":5794,"question_id":6,"text":"","created_at":"2018-05-10 16:59:08 UTC","updated_at":"2018-06-14 20:53:37 UTC","archived":1,"plan_id":5805,"archived_by":5794},{"id":926,"user_id":5798,"question_id":267,"text":"","created_at":"2018-05-10 20:20:20 UTC","updated_at":"2018-05-10 20:20:20 UTC","archived":null,"plan_id":5839,"archived_by":null},{"id":927,"user_id":5798,"question_id":280,"text":"","created_at":"2018-05-10 20:20:21 UTC","updated_at":"2018-05-10 20:20:21 UTC","archived":null,"plan_id":5839,"archived_by":null},{"id":928,"user_id":5798,"question_id":276,"text":"","created_at":"2018-05-10 20:28:51 UTC","updated_at":"2018-05-10 20:28:51 UTC","archived":null,"plan_id":5839,"archived_by":null},{"id":929,"user_id":5798,"question_id":277,"text":"","created_at":"2018-05-10 20:28:52 UTC","updated_at":"2018-05-10 20:28:52 UTC","archived":null,"plan_id":5839,"archived_by":null},{"id":930,"user_id":5798,"question_id":278,"text":"","created_at":"2018-05-10 20:28:52 UTC","updated_at":"2018-05-10 20:28:52 UTC","archived":null,"plan_id":5839,"archived_by":null},{"id":931,"user_id":2771,"question_id":195,"text":"<p>File types are an essential consideration in data storage.</p>\r\n<p>Be aware of propritery vs non-proprietary formats.</p>\r\n<p>When choosing how to save your files chose a format that is:</p>\r\n<ul>\r\n<li>Non-proprietary</li>\r\n<li>Open, with documented standards</li>\r\n<li>Used by your community</li>\r\n<li>Encoded using standard character encoding</li>\r\n<li>Uncompressed</li>\r\n</ul>\r\n<p>&nbsp;</p>","created_at":"2018-05-13 17:02:29 UTC","updated_at":"2018-05-13 17:02:29 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":932,"user_id":2771,"question_id":197,"text":"<p>Documentation - important to record information about the data as you collect it. Properly naming columns, describing any formulas used to create date, listing where and when data was collected, etc. will help re-use of data.</p>","created_at":"2018-05-13 17:10:51 UTC","updated_at":"2018-05-13 17:10:51 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":933,"user_id":2771,"question_id":200,"text":"<p>can plan for long term storage, preservation, and backup by using data repositories such as Dryad or Dataverse.</p>","created_at":"2018-05-13 17:15:07 UTC","updated_at":"2018-05-13 17:15:07 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":934,"user_id":2771,"question_id":202,"text":"<p>Plans to share data; scope of data</p>","created_at":"2018-05-13 17:16:02 UTC","updated_at":"2018-05-13 17:16:02 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":935,"user_id":2771,"question_id":202,"text":"<p>Sharing datasets - be thoughtful of how and where sharing. For sensitive data, avoid google, drop box, where storage is not an institutional space or supported by your institution. For Queen's, storage and sharing space available with Queen's OneDrive, QShare, providing encryption and password protection.</p>","created_at":"2018-05-13 17:19:34 UTC","updated_at":"2018-05-13 17:19:34 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":936,"user_id":2771,"question_id":206,"text":"<p>Creative Commons</p>\r\n<p>Dataverse - has standard terms of use; default CC is CC open. These can be changed based on needs of your dataset.&nbsp;</p>\r\n<p>Dataverse also provides various levels of restrictions fro datasets and files.</p>","created_at":"2018-05-13 17:29:26 UTC","updated_at":"2018-05-13 17:29:26 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":937,"user_id":2771,"question_id":212,"text":"<p>Secondary uses of sensitive data can be driven by ehtics boards and/or end-user licences/terms of data.&nbsp;</p>\r\n<p>Datasets can also be resticting of files, creating subsets of data or public use versions of data.</p>","created_at":"2018-05-13 17:32:33 UTC","updated_at":"2018-05-13 17:32:33 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":938,"user_id":2771,"question_id":196,"text":"<p>It is recommended that you choose a file naming convention and stick with it. Make sure that everyone on your team is following the same rules for naming files. When deciding how to name your files remember the following:</p>\r\n<ul>\r\n<li>Keep file names under 32 characters</li>\r\n<li>Classify broad types of files (transcript, photo, etc.)</li>\r\n<li>Avoid spaces and special characters</li>\r\n<li>Use underscores instead of periods or spaces</li>\r\n<li>Make sure that file names are descriptive outside of their folders (in case they are misplaced or change locations); i.e., the file name should include all necessary descriptive information</li>\r\n<li>Include dates and format them consistently (international standard for date notation is YYYY_MM_DD or YYYYMMDD)</li>\r\n<li>Include a version number to track multiple versions of a document</li>\r\n<li>Be consistent!</li>\r\n</ul>","created_at":"2018-05-13 17:38:30 UTC","updated_at":"2018-05-13 17:38:30 UTC","archived":null,"plan_id":5775,"archived_by":null},{"id":939,"user_id":5822,"question_id":202,"text":"<p>Titre des fichiers : ann&eacute;e-mois-jour et description</p>","created_at":"2018-05-14 20:08:38 UTC","updated_at":"2018-05-14 20:08:38 UTC","archived":null,"plan_id":5855,"archived_by":null},{"id":940,"user_id":5834,"question_id":194,"text":"","created_at":"2018-05-17 13:17:47 UTC","updated_at":"2018-05-17 13:17:47 UTC","archived":null,"plan_id":5869,"archived_by":null},{"id":941,"user_id":5846,"question_id":196,"text":"","created_at":"2018-05-22 08:32:50 UTC","updated_at":"2018-05-22 08:32:50 UTC","archived":null,"plan_id":5879,"archived_by":null},{"id":942,"user_id":5846,"question_id":207,"text":"","created_at":"2018-05-22 08:35:01 UTC","updated_at":"2018-05-22 08:35:01 UTC","archived":null,"plan_id":5879,"archived_by":null},{"id":943,"user_id":3451,"question_id":194,"text":"<p>Sarah - don't forget about the field lab stuff.</p>","created_at":"2018-05-22 13:41:46 UTC","updated_at":"2018-05-22 13:41:46 UTC","archived":null,"plan_id":5880,"archived_by":null},{"id":944,"user_id":117,"question_id":194,"text":"<p>Using external sources pending approval for direct interviews?</p>","created_at":"2018-05-23 18:00:48 UTC","updated_at":"2018-05-23 18:00:48 UTC","archived":null,"plan_id":5893,"archived_by":null},{"id":945,"user_id":5708,"question_id":194,"text":"<p>External data sources being used.</p>","created_at":"2018-05-23 18:00:54 UTC","updated_at":"2018-05-23 18:00:54 UTC","archived":null,"plan_id":5894,"archived_by":null},{"id":946,"user_id":5839,"question_id":195,"text":"<p>Hi Erin. Please look into MP4 as proprietary.</p>\r\n<p>Sincerely,</p>\r\n<p>Danae</p>","created_at":"2018-05-24 02:19:55 UTC","updated_at":"2018-05-24 02:19:55 UTC","archived":null,"plan_id":5896,"archived_by":null},{"id":947,"user_id":5839,"question_id":204,"text":"<p>Erin.</p>","created_at":"2018-05-24 02:32:53 UTC","updated_at":"2018-05-24 02:32:53 UTC","archived":null,"plan_id":5896,"archived_by":null},{"id":948,"user_id":4437,"question_id":195,"text":"<p>MP4 is good - listed by the library of congress as a sustainable digital fomat</p>","created_at":"2018-05-24 16:39:15 UTC","updated_at":"2018-05-24 16:39:15 UTC","archived":null,"plan_id":5896,"archived_by":null},{"id":949,"user_id":4437,"question_id":196,"text":"<p>Logical file stucture to use would be Interview1-datecreated/revised (so rename file if you update with a new version - this is probably not overly relevant to your work, but an example might be, revised date if you edited the transcript to add missing detail - not inaudible, for ex.)&nbsp; Structure your file names in a pattern</p>","created_at":"2018-05-24 16:43:56 UTC","updated_at":"2018-05-24 16:43:56 UTC","archived":null,"plan_id":5896,"archived_by":null},{"id":950,"user_id":4437,"question_id":198,"text":"<p>will use consistent file naming convention?&nbsp;</p>","created_at":"2018-05-24 16:48:50 UTC","updated_at":"2018-05-24 16:48:50 UTC","archived":null,"plan_id":5896,"archived_by":null},{"id":951,"user_id":4437,"question_id":198,"text":"<p>You might also want to write a small paragraph that outlines how you will collect data (in MP4, using set file naming convention, saved in locations A and B) basically outline of some things in this form but accessible at a quick glance</p>","created_at":"2018-05-24 16:51:07 UTC","updated_at":"2018-05-24 16:51:07 UTC","archived":null,"plan_id":5896,"archived_by":null},{"id":952,"user_id":4437,"question_id":203,"text":"<p>Dataverse supports use restrictions, provides a back up copy and is a convenient way to disseminate you data.&nbsp; Dataverse will only support 2 GB of space. Read more&nbsp;http://guides.scholarsportal.info/dataverse</p>","created_at":"2018-05-24 18:16:27 UTC","updated_at":"2018-05-24 18:16:27 UTC","archived":null,"plan_id":5896,"archived_by":null},{"id":953,"user_id":55,"question_id":20,"text":"","created_at":"2018-05-31 19:03:45 UTC","updated_at":"2018-05-31 19:03:45 UTC","archived":null,"plan_id":5920,"archived_by":null},{"id":954,"user_id":5890,"question_id":194,"text":"","created_at":"2018-06-02 13:36:47 UTC","updated_at":"2018-06-02 13:36:47 UTC","archived":null,"plan_id":5922,"archived_by":null},{"id":955,"user_id":5890,"question_id":196,"text":"","created_at":"2018-06-02 13:36:47 UTC","updated_at":"2018-06-02 13:36:47 UTC","archived":null,"plan_id":5922,"archived_by":null},{"id":956,"user_id":5890,"question_id":200,"text":"","created_at":"2018-06-02 14:46:26 UTC","updated_at":"2018-06-02 14:46:26 UTC","archived":null,"plan_id":5922,"archived_by":null},{"id":957,"user_id":5890,"question_id":202,"text":"","created_at":"2018-06-02 14:46:26 UTC","updated_at":"2018-06-02 14:46:26 UTC","archived":null,"plan_id":5922,"archived_by":null},{"id":958,"user_id":5812,"question_id":196,"text":"","created_at":"2018-06-04 13:18:55 UTC","updated_at":"2018-06-04 13:18:55 UTC","archived":null,"plan_id":5850,"archived_by":null},{"id":959,"user_id":5812,"question_id":199,"text":"","created_at":"2018-06-04 13:35:24 UTC","updated_at":"2018-06-04 13:35:24 UTC","archived":null,"plan_id":5850,"archived_by":null},{"id":960,"user_id":5812,"question_id":202,"text":"","created_at":"2018-06-04 13:41:10 UTC","updated_at":"2018-06-04 13:41:10 UTC","archived":null,"plan_id":5850,"archived_by":null},{"id":961,"user_id":5812,"question_id":210,"text":"","created_at":"2018-06-04 13:47:27 UTC","updated_at":"2018-06-04 13:47:27 UTC","archived":null,"plan_id":5850,"archived_by":null},{"id":962,"user_id":5906,"question_id":196,"text":"","created_at":"2018-06-05 15:29:25 UTC","updated_at":"2018-06-05 15:29:25 UTC","archived":null,"plan_id":5933,"archived_by":null},{"id":963,"user_id":5903,"question_id":202,"text":"","cr