ific processes and people where able. If you aren't there yet then I might suggest that stating that a data management protocol will be developed and that within this reoles and responsibilities will be identified.&nbsp;</p>","created_at":"2018-10-01 18:31:47 UTC","updated_at":"2018-10-01 18:31:47 UTC","archived":null,"plan_id":6332,"archived_by":null},{"id":1048,"user_id":5257,"question_id":209,"text":"<p>Relating to the previous note, you can also say that for specific processes/tasks there will be both primary and secondary (coverage when needed and if changes occur) individuals identified.</p>","created_at":"2018-10-01 18:34:25 UTC","updated_at":"2018-10-01 18:34:25 UTC","archived":null,"plan_id":6332,"archived_by":null},{"id":1049,"user_id":5257,"question_id":213,"text":"<p>Could add that, as necessary, access restrictions and customized terms of use can be developed and included with the data when deposited with FRDR for long-term stewardship.</p>","created_at":"2018-10-01 18:37:21 UTC","updated_at":"2018-10-01 18:37:21 UTC","archived":null,"plan_id":6332,"archived_by":null},{"id":1050,"user_id":5257,"question_id":198,"text":"<p>You mention using industry standards re: metadata in the previous section, may be good to include here as well and any additional information that you might have about those.&nbsp;</p>","created_at":"2018-10-01 18:39:22 UTC","updated_at":"2018-10-01 18:39:22 UTC","archived":null,"plan_id":6332,"archived_by":null},{"id":1051,"user_id":5257,"question_id":199,"text":"<p>See previous note</p>","created_at":"2018-10-01 18:39:54 UTC","updated_at":"2018-10-01 18:39:54 UTC","archived":null,"plan_id":6332,"archived_by":null},{"id":1052,"user_id":5257,"question_id":200,"text":"<p>For this and the next question - typically you may need to give more clarification about exactly how the data are going to be stored - e.g., cloud based servers (which then can be remotely accessed by geographically disperesed collaborators), local servers (and then how will data be shared with collaborators), etc. Depending upon these details, can then further clarify details re backups (e.g., automated processes taken care of for you, manual, onsite/offsite copies, etc)</p>","created_at":"2018-10-01 18:45:08 UTC","updated_at":"2018-10-01 18:45:08 UTC","archived":null,"plan_id":6332,"archived_by":null},{"id":1053,"user_id":5257,"question_id":203,"text":"<p>FRDR is pretty new, so should assume that anyone reviewing this may not know much about it - might be good to give a brief description (see my slides and website) and the link</p>","created_at":"2018-10-01 18:46:51 UTC","updated_at":"2018-10-01 18:46:51 UTC","archived":null,"plan_id":6332,"archived_by":null},{"id":1054,"user_id":6490,"question_id":202,"text":"","created_at":"2018-10-03 15:48:35 UTC","updated_at":"2018-10-03 15:48:35 UTC","archived":null,"plan_id":6481,"archived_by":null},{"id":1055,"user_id":6490,"question_id":202,"text":"","created_at":"2018-10-03 15:53:03 UTC","updated_at":"2018-10-03 15:53:03 UTC","archived":null,"plan_id":6481,"archived_by":null},{"id":1056,"user_id":6490,"question_id":196,"text":"","created_at":"2018-10-03 19:37:10 UTC","updated_at":"2018-10-03 19:37:10 UTC","archived":null,"plan_id":6481,"archived_by":null},{"id":1057,"user_id":5801,"question_id":260,"text":"","created_at":"2018-10-03 20:40:21 UTC","updated_at":"2018-10-03 20:40:21 UTC","archived":null,"plan_id":5843,"archived_by":null},{"id":1058,"user_id":6510,"question_id":208,"text":"","created_at":"2018-10-04 20:36:31 UTC","updated_at":"2018-10-04 20:36:31 UTC","archived":null,"plan_id":6501,"archived_by":null},{"id":1059,"user_id":6510,"question_id":209,"text":"","created_at":"2018-10-04 20:36:31 UTC","updated_at":"2018-10-04 20:36:31 UTC","archived":null,"plan_id":6501,"archived_by":null},{"id":1060,"user_id":6510,"question_id":210,"text":"","created_at":"2018-10-04 20:36:31 UTC","updated_at":"2018-10-04 20:36:31 UTC","archived":null,"plan_id":6501,"archived_by":null},{"id":1061,"user_id":778,"question_id":20,"text":"","created_at":"2018-10-05 18:34:29 UTC","updated_at":"2018-10-05 18:34:29 UTC","archived":null,"plan_id":609,"archived_by":null},{"id":1062,"user_id":6325,"question_id":327,"text":"","created_at":"2018-10-08 21:28:19 UTC","updated_at":"2018-10-08 21:28:19 UTC","archived":null,"plan_id":6338,"archived_by":null},{"id":1063,"user_id":6533,"question_id":210,"text":"","created_at":"2018-10-10 20:37:28 UTC","updated_at":"2018-10-10 20:37:28 UTC","archived":null,"plan_id":6522,"archived_by":null},{"id":1064,"user_id":6531,"question_id":207,"text":"","created_at":"2018-10-10 20:42:31 UTC","updated_at":"2018-10-10 20:42:31 UTC","archived":null,"plan_id":6523,"archived_by":null},{"id":1065,"user_id":6451,"question_id":196,"text":"","created_at":"2018-10-16 19:37:42 UTC","updated_at":"2018-10-18 19:46:27 UTC","archived":1,"plan_id":6449,"archived_by":6451},{"id":1066,"user_id":6563,"question_id":202,"text":"","created_at":"2018-10-18 17:10:33 UTC","updated_at":"2018-10-18 17:10:33 UTC","archived":null,"plan_id":6559,"archived_by":null},{"id":1067,"user_id":6451,"question_id":194,"text":"<p>Will&nbsp;we collect other kinds of data?</p>\r\n<p>&nbsp;</p>","created_at":"2018-10-18 19:43:14 UTC","updated_at":"2018-10-18 19:43:14 UTC","archived":null,"plan_id":6449,"archived_by":null},{"id":1068,"user_id":6451,"question_id":196,"text":"","created_at":"2018-10-19 20:19:25 UTC","updated_at":"2018-10-19 20:19:25 UTC","archived":null,"plan_id":6449,"archived_by":null},{"id":1069,"user_id":4121,"question_id":196,"text":"","created_at":"2018-10-22 18:56:55 UTC","updated_at":"2018-10-22 18:56:55 UTC","archived":null,"plan_id":4735,"archived_by":null},{"id":1070,"user_id":4121,"question_id":195,"text":"","created_at":"2018-10-22 18:56:56 UTC","updated_at":"2018-10-22 18:56:56 UTC","archived":null,"plan_id":4735,"archived_by":null},{"id":1071,"user_id":6451,"question_id":194,"text":"<p>Will we collect other kinds of data?&nbsp;</p>","created_at":"2018-10-22 20:54:56 UTC","updated_at":"2018-10-22 20:54:56 UTC","archived":null,"plan_id":6449,"archived_by":null},{"id":1072,"user_id":6539,"question_id":204,"text":"","created_at":"2018-10-22 23:52:12 UTC","updated_at":"2018-10-22 23:52:12 UTC","archived":null,"plan_id":6529,"archived_by":null},{"id":1073,"user_id":6280,"question_id":204,"text":"","created_at":"2018-10-24 14:55:37 UTC","updated_at":"2018-10-24 14:55:37 UTC","archived":null,"plan_id":6586,"archived_by":null},{"id":1074,"user_id":6439,"question_id":195,"text":"<p>Data collected from less accessible formats (ex. GIS, print reports form municipalities) can be coded into excel to be made more accessible for future use. We can probably also archive the government reports that are the source for water system information, and create a guide for accessing the files. GIS raw data sources should just be sourced so that the analysis could be replicated.&nbsp;</p>","created_at":"2018-10-29 14:28:31 UTC","updated_at":"2018-10-29 14:28:31 UTC","archived":null,"plan_id":6437,"archived_by":null},{"id":1075,"user_id":6439,"question_id":196,"text":"<p>I've only established naming conventions for data that we currently have. Spatial and master/regression files TBD.&nbsp;</p>","created_at":"2018-10-29 15:10:11 UTC","updated_at":"2018-10-29 15:10:11 UTC","archived":null,"plan_id":6437,"archived_by":null},{"id":1076,"user_id":6439,"question_id":197,"text":"<p>I can start developing these metadata now.&nbsp;</p>","created_at":"2018-10-29 15:22:27 UTC","updated_at":"2018-10-29 15:22:27 UTC","archived":null,"plan_id":6437,"archived_by":null},{"id":1077,"user_id":6439,"question_id":199,"text":"<p>I will work on developing this, after reviewing metadata conventions for similar datasets.&nbsp;</p>","created_at":"2018-10-29 15:25:31 UTC","updated_at":"2018-10-29 15:25:31 UTC","archived":null,"plan_id":6437,"archived_by":null},{"id":1078,"user_id":6439,"question_id":200,"text":"<p>The library should be able to provide perpetual storage for us, but will need to double check.&nbsp;</p>","created_at":"2018-10-29 15:28:22 UTC","updated_at":"2018-10-29 15:28:22 UTC","archived":null,"plan_id":6437,"archived_by":null},{"id":1079,"user_id":6439,"question_id":204,"text":"<p>I should probably touch base with library staff in the next few months (as the data collection wraps up) to get their input on the DMP.&nbsp;</p>","created_at":"2018-10-29 15:31:01 UTC","updated_at":"2018-10-29 15:31:01 UTC","archived":null,"plan_id":6437,"archived_by":null},{"id":1080,"user_id":6645,"question_id":195,"text":"","created_at":"2018-10-30 18:01:56 UTC","updated_at":"2018-10-30 18:01:56 UTC","archived":null,"plan_id":6634,"archived_by":null},{"id":1081,"user_id":6645,"question_id":196,"text":"","created_at":"2018-10-30 18:01:56 UTC","updated_at":"2018-10-30 18:01:56 UTC","archived":null,"plan_id":6634,"archived_by":null},{"id":1082,"user_id":6645,"question_id":197,"text":"","created_at":"2018-10-30 18:16:43 UTC","updated_at":"2018-10-30 18:16:43 UTC","archived":null,"plan_id":6634,"archived_by":null},{"id":1083,"user_id":6645,"question_id":198,"text":"","created_at":"2018-10-30 18:16:44 UTC","updated_at":"2018-10-30 18:16:44 UTC","archived":null,"plan_id":6634,"archived_by":null},{"id":1084,"user_id":6645,"question_id":199,"text":"","created_at":"2018-10-30 18:16:44 UTC","updated_at":"2018-10-30 18:16:44 UTC","archived":null,"plan_id":6634,"archived_by":null},{"id":1085,"user_id":117,"question_id":196,"text":"","created_at":"2018-10-30 23:08:24 UTC","updated_at":"2018-10-30 23:08:24 UTC","archived":null,"plan_id":6647,"archived_by":null},{"id":1086,"user_id":2805,"question_id":199,"text":"","created_at":"2018-10-31 16:40:01 UTC","updated_at":"2018-10-31 16:40:01 UTC","archived":null,"plan_id":6653,"archived_by":null},{"id":1087,"user_id":6551,"question_id":538,"text":"","created_at":"2018-10-31 17:53:06 UTC","updated_at":"2018-10-31 17:53:06 UTC","archived":null,"plan_id":6543,"archived_by":null},{"id":1088,"user_id":6670