UTC","archived":null,"plan_id":7140,"archived_by":null},{"id":1371,"user_id":7834,"question_id":203,"text":"<p>Does MUN have a system of long term data storage and archiving if SLGO were to no longer be able to house data?</p>","created_at":"2019-02-27 18:59:21 UTC","updated_at":"2019-02-27 18:59:21 UTC","archived":null,"plan_id":7140,"archived_by":null},{"id":1372,"user_id":7834,"question_id":206,"text":"<p>Do you have a preference/does MUN have a policy for the type of end-user license to include with the data?</p>","created_at":"2019-02-27 19:11:12 UTC","updated_at":"2019-02-27 19:11:12 UTC","archived":null,"plan_id":7140,"archived_by":null},{"id":1373,"user_id":7834,"question_id":207,"text":"<p>Anything to change or add here? What sort of steps do you normally take to let the research community know your data exists?</p>","created_at":"2019-02-27 19:19:54 UTC","updated_at":"2019-02-27 19:19:54 UTC","archived":null,"plan_id":7140,"archived_by":null},{"id":1374,"user_id":7834,"question_id":208,"text":"<p>Is there someone else who manages your group data over the long term?</p>","created_at":"2019-02-27 19:26:23 UTC","updated_at":"2019-02-27 19:26:23 UTC","archived":null,"plan_id":7140,"archived_by":null},{"id":1375,"user_id":7834,"question_id":197,"text":"<p>Waiting on standardized list from SLGO for this, but will also populate with some ideas for project specifics.</p>","created_at":"2019-02-28 17:31:18 UTC","updated_at":"2019-02-28 17:31:18 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1376,"user_id":7834,"question_id":206,"text":"<p>This will be a matter of personal preference here. More information will be needed on what type of user licenses can be made available and what ACAP HA's preference for protection of their intellectual property will be.</p>","created_at":"2019-02-28 18:57:26 UTC","updated_at":"2019-02-28 18:57:26 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1377,"user_id":7834,"question_id":208,"text":"<p>Will need clarification here on who has what roles for managing data within ACAP HA.</p>","created_at":"2019-02-28 19:05:47 UTC","updated_at":"2019-02-28 19:05:47 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1378,"user_id":7834,"question_id":211,"text":"<p>Is there any sensitive data in this project? It doesn't appear that anything would carry personally sensitive data from the initial outset.</p>","created_at":"2019-02-28 19:09:54 UTC","updated_at":"2019-02-28 19:12:23 UTC","archived":1,"plan_id":7144,"archived_by":7834},{"id":1379,"user_id":7834,"question_id":211,"text":"","created_at":"2019-02-28 19:12:23 UTC","updated_at":"2019-02-28 19:12:23 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1380,"user_id":7834,"question_id":211,"text":"","created_at":"2019-02-28 19:12:23 UTC","updated_at":"2019-02-28 19:12:23 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1381,"user_id":7834,"question_id":212,"text":"","created_at":"2019-02-28 19:12:24 UTC","updated_at":"2019-02-28 19:12:24 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1382,"user_id":7834,"question_id":213,"text":"<p>This likely needs to be more case specific than the generalized line item here.</p>","created_at":"2019-02-28 19:12:24 UTC","updated_at":"2019-02-28 19:12:24 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1383,"user_id":7834,"question_id":213,"text":"<p>This likely needs to be more case specific than the generalized line item here.</p>","created_at":"2019-02-28 19:12:24 UTC","updated_at":"2019-02-28 19:12:24 UTC","archived":null,"plan_id":7144,"archived_by":null},{"id":1384,"user_id":7834,"question_id":196,"text":"","created_at":"2019-03-01 14:15:28 UTC","updated_at":"2019-03-01 14:17:57 UTC","archived":1,"plan_id":7149,"archived_by":7834},{"id":1385,"user_id":7834,"question_id":194,"text":"<p>Is there an intention to share data from surveys in a map form (e.g. raster, shapefile, etc.)?</p>","created_at":"2019-03-01 14:17:34 UTC","updated_at":"2019-03-01 14:17:34 UTC","archived":null,"plan_id":7149,"archived_by":null},{"id":1386,"user_id":7834,"question_id":194,"text":"<p>Will there be images taken as part of site descriptions/photos?</p>","created_at":"2019-03-01 14:51:09 UTC","updated_at":"2019-03-01 14:51:09 UTC","archived":null,"plan_id":7149,"archived_by":null},{"id":1387,"user_id":7834,"question_id":195,"text":"<p>What type of format will the videos be collected in? AVI, MOV? Best guess is currently identified.</p>","created_at":"2019-03-01 14:54:08 UTC","updated_at":"2019-03-01 14:54:08 UTC","archived":null,"plan_id":7149,"archived_by":null},{"id":1388,"user_id":7834,"question_id":197,"text":"<p>This will be better fleshed out once a standardized list of metadata needs is received from SLGO.</p>","created_at":"2019-03-01 15:14:17 UTC","updated_at":"2019-03-01 15:14:17 UTC","archived":null,"plan_id":7149,"archived_by":null},{"id":1389,"user_id":7834,"question_id":208,"text":"<p>Please indicate whether this is an acurate representation of how the data management responsibilities will be broken out for the project.</p>","created_at":"2019-03-01 17:28:01 UTC","updated_at":"2019-03-01 17:28:01 UTC","archived":null,"plan_id":7149,"archived_by":null},{"id":1390,"user_id":7773,"question_id":194,"text":"<p>Will the physical characteristics of deep-water spawning sites, including bathymetric features, depth, sediment size, temperature, salinity and conductivity data be tabular or raster?</p>","created_at":"2019-03-04 14:27:25 UTC","updated_at":"2019-03-04 14:27:25 UTC","archived":null,"plan_id":7141,"archived_by":null},{"id":1391,"user_id":7773,"question_id":195,"text":"<p>What data formats do you expect to have? Please add to or modify this list.</p>","created_at":"2019-03-04 14:34:51 UTC","updated_at":"2019-03-04 14:34:51 UTC","archived":null,"plan_id":7141,"archived_by":null},{"id":1392,"user_id":7773,"question_id":200,"text":"<p>Could you speak to the estimated storage space requirement?&nbsp;</p>","created_at":"2019-03-04 19:30:21 UTC","updated_at":"2019-03-04 19:30:21 UTC","archived":null,"plan_id":7141,"archived_by":null},{"id":1393,"user_id":7773,"question_id":205,"text":"<p>Do you plan on sharing raw data files or post-processed data/products?</p>","created_at":"2019-03-04 19:36:17 UTC","updated_at":"2019-03-04 19:36:17 UTC","archived":null,"plan_id":7141,"archived_by":null},{"id":1394,"user_id":7773,"question_id":208,"text":"<p>Outside of SLGOs role, who is responsibel in your group?</p>","created_at":"2019-03-04 19:37:52 UTC","updated_at":"2019-03-04 19:37:52 UTC","archived":null,"plan_id":7141,"archived_by":null},{"id":1395,"user_id":7881,"question_id":197,"text":"","created_at":"2019-03-04 19:53:04 UTC","updated_at":"2019-03-04 19:53:04 UTC","archived":null,"plan_id":7158,"archived_by":null},{"id":1396,"user_id":7882,"question_id":538,"text":"","created_at":"2019-03-04 21:45:46 UTC","updated_at":"2019-03-04 21:45:46 UTC","archived":null,"plan_id":7159,"archived_by":null},{"id":1397,"user_id":7887,"question_id":536,"text":"","created_at":"2019-03-04 21:58:17 UTC","updated_at":"2019-03-04 21:58:17 UTC","archived":null,"plan_id":7163,"archived_by":null},{"id":1398,"user_id":7887,"question_id":537,"text":"","created_at":"2019-03-04 21:59:24 UTC","updated_at":"2019-03-04 21:59:24 UTC","archived":null,"plan_id":7163,"archived_by":null},{"id":1399,"user_id":7834,"question_id":195,"text":"<p>What file types will the orthimages be stored as? Also, will the DSM be stored as a raster, vector or text file? (e.g. ASCII, DEM, FLt)?</p>","created_at":"2019-03-05 13:52:55 UTC","updated_at":"2019-03-05 14:07:35 UTC","archived":null,"plan_id":7153,"archived_by":null},{"id":1400,"user_id":7834,"question_id":197,"text":"<p>Note:&nbsp;This is not a finalized list. Metadata needs will be filled in more by folks from SLGO.</p>","created_at":"2019-03-05 14:14:22 UTC","updated_at":"2019-03-05 14:14:22 UTC","archived":null,"plan_id":7153,"archived_by":null},{"id":1401,"user_id":7834,"question_id":200,"text":"<p>Can you please confirm how much space you anticipate needing for storage of DSMs and orthoimagery?</p>","created_at":"2019-03-05 14:37:22 UTC","updated_at":"2019-03-05 14:37:22 UTC","archived":null,"plan_id":7153,"archived_by":null},{"id":1402,"user_id":7834,"question_id":203,"text":"<p>Does NAACAP have any other plans for long term preservation of the data at the end of the porject?</p>","created_at":"2019-03-05 14:50:07 UTC","updated_at":"2019-03-05 14:50:07 UTC","archived":null,"plan_id":7153,"archived_by":null},{"id":1403,"user_id":7834,"question_id":204,"text":"<p>What format would DSMs be saved under?</p>","created_at":"2019-03-05 14:52:35 UTC","updated_at":"2019-03-05 14:52:35 UTC","archived":null,"plan_id":7153,"archived_by":null},{"id":1404,"user_id":7834,"question_id":208,"text":"<p>Please make any changes according to how NAACAP's internal structure and oversight of the project is actually being carried out. This was a best guess based on the project proposal.</p>","created_at":"2019-03-05 15:07:36 UTC","updated_at":"2019-03-05 15:07:36 UTC","archived":null,"plan_id":7153,"archived_by":null},{"id":1405,"user_id":7834,"question_id":211,"text":"<p>Will the data being collected by GSNL be considered sensitive? If not, then we can just enter 'Not Applicable' for the sensitivity of these sections.</p>","created_at":"2019-03-05 15:09:02 UTC","updated_at":"2019-03-05 15:10:27 UTC","archived":null,"plan_id":7153,"archived_by":null},{"id":1406,"user_id":7834,"question_id":195,"text":"<p>Please confirm what and/or if you will be collecting audio files and how these files might be stored, or whether all data is planned to be post processed to a word document (e.g. TXT)</p>","created_at":"2019-03-06 14:39:57 UTC","updated_at":"2019-03-06 14:39:57 UTC","archived":null,"plan_id":7165,"archived_by":null},{"id":1407,"user_id":7773,"question_id":194,"text":"<p>Could you specify any other data products/types?</p>\r\n<p>Will the data produced from analyses be in a tabular (CSV/Excel) or numeric from?</p>\r\n<p>There is mention of qualitiaive data as well. Will that be in the form of written reports or analyzed trend data?</p>","created_at":"2019-03-06 15:02:45 UTC","updated_at":"2019-03-06 15:02:45 UTC","archived":null,"plan_id":7164,"archived_by":null},{"id":1408,"user_id":7834,"question_id":197,"text":"<p>We are waiting on a generic list of metadata needs from the external data provider to finish completing this section. If there are other things you can see are missing or need to be changed here, please add them.</p>","created_at":"2019-03-06 15:10:44 UTC","updated_at":"2019-03-06 15:10:44 UTC","archived":null,"plan_id":7165,"archived_by":null},{"id":1409,"user_id":7834,"question_id":203,"text":"<ul>\r\n<li>Is there an electronic questionnaire being used to collect the information or is it mostly paper-based? Do you have plans to house the information internally, or elsewhere (i.e. cloud-based storage, online database, library, etc)</li>\r\n</ul>","created_at":"2019-03-06 16:54:45 UTC","updated_at":"2019-03-06 16:54:45 UTC","archived":null,"plan_id":7165,"archived_by":null},{"id":1410,"user_id":7834,"question_id":206,"text":"<p>Seeking guidance and examples from SLGO on types of possible licences through their database, if required in this case.</p>","created_at":"2019-03-06 17:23:43 UTC","updated_at":"2019-03-06 17:23:43 UTC","archived":null,"plan_id":7165,"archived_by":null},{"id":1411,"user_id":7834,"question_id":210,"text":"","created_at":"2019-03-06 17:40:59 UTC","updated_at":"2019-03-06 17:40:59 UTC","archived":null,"plan_id":7165,"archived_by":null},{"id":1412,"user_id":7834,"question_id":209,"text":"<p>What will happen in this case if Dwan is no longer the project coordinator? How would FFAW/Unifor ensure the project is still completed in this case?</p>","created_at":"2019-03-06 17:48:46 UTC","updated_at":"2019-03-06 17:48:46 UTC","archived":null,"plan_id":7165,"archived_by":null},{"