5,"archived_by":null},{"id":1660,"user_id":8567,"question_id":201,"text":"<p>En r&eacute;seau ferm&eacute; ? Sinon ok pour le reste</p>","created_at":"2019-07-03 21:14:29 UTC","updated_at":"2019-07-03 21:14:29 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1661,"user_id":8567,"question_id":202,"text":"<p>Dropbox c'est pas assex s&eacute;curitaire... Jacinthe ?&nbsp;</p>","created_at":"2019-07-03 21:29:39 UTC","updated_at":"2019-07-03 21:29:39 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1662,"user_id":8567,"question_id":202,"text":"<p>Dropbox c'est pas assex s&eacute;curitaire... Jacinthe ?&nbsp;</p>","created_at":"2019-07-03 21:29:39 UTC","updated_at":"2019-08-07 19:22:19 UTC","archived":1,"plan_id":7635,"archived_by":8957},{"id":1663,"user_id":8567,"question_id":205,"text":"<p>au sein de l'&eacute;quipe constitu&eacute; de co-chercheur(e)s, d'assistant(e)s et d'une coordonnatrice. Qu'en penses-tu ?</p>","created_at":"2019-07-03 21:33:44 UTC","updated_at":"2019-07-03 21:33:44 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1664,"user_id":8567,"question_id":205,"text":"<p>au sein de l'&eacute;quipe constitu&eacute; de co-chercheur(e)s, d'assistant(e)s et d'une coordonnatrice. Qu'en penses-tu ?</p>\r\n<p>&nbsp;</p>\r\n<p>Pour les donn&eacute;es d&eacute;finitives je ne sais pas.&nbsp;</p>","created_at":"2019-07-03 21:33:44 UTC","updated_at":"2019-07-03 21:34:59 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1665,"user_id":8567,"question_id":209,"text":"<p>Je les nommerai tous !&nbsp;</p>","created_at":"2019-07-03 21:39:24 UTC","updated_at":"2019-07-03 21:39:24 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1666,"user_id":8567,"question_id":209,"text":"<p>Je les nommerai tous !&nbsp;</p>","created_at":"2019-07-03 21:39:24 UTC","updated_at":"2019-07-03 21:39:24 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1667,"user_id":8567,"question_id":211,"text":"<p>Yes ! C'est exactement &ccedil;a !&nbsp;</p>","created_at":"2019-07-03 21:40:28 UTC","updated_at":"2019-07-03 21:40:28 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1668,"user_id":8567,"question_id":211,"text":"<p>Yes ! C'est exactement &ccedil;a !&nbsp;</p>","created_at":"2019-07-03 21:40:28 UTC","updated_at":"2019-07-03 21:40:28 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1669,"user_id":8567,"question_id":212,"text":"<p>Oui toutes ces conditions sont inscrites dans le formulaire d'information et de consentement. Si jamais tu en as besoin, fais moi signe !&nbsp;</p>","created_at":"2019-07-03 21:42:19 UTC","updated_at":"2019-07-03 21:42:19 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1670,"user_id":8567,"question_id":212,"text":"<p>Oui toutes ces conditions sont inscrites dans le formulaire d'information et de consentement. Si jamais tu en as besoin, fais moi signe !&nbsp;</p>","created_at":"2019-07-03 21:42:19 UTC","updated_at":"2019-07-03 21:42:19 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1671,"user_id":8567,"question_id":213,"text":"<p>Encore une fois, je pense FIC dans lequel les personnes s'engagent &agrave; participer &agrave; la recherche et &agrave; donc produire des donn&eacute;es qui appartiendront aux chercheurs. Pour le reste, je ne sais pas.... Jacinthe ?&nbsp;</p>","created_at":"2019-07-03 21:45:28 UTC","updated_at":"2019-07-03 21:45:28 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1672,"user_id":8567,"question_id":213,"text":"<p>Encore une fois, je pense FIC dans lequel les personnes s'engagent &agrave; participer &agrave; la recherche et &agrave; donc produire des donn&eacute;es qui appartiendront aux chercheurs. Pour le reste, je ne sais pas.... Jacinthe ?&nbsp;</p>","created_at":"2019-07-03 21:45:29 UTC","updated_at":"2019-07-03 21:45:29 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1673,"user_id":8567,"question_id":195,"text":"<p>Ok !&nbsp;</p>","created_at":"2019-07-03