":"2019-07-09 18:08:06 UTC","archived":null,"plan_id":7718,"archived_by":null},{"id":1684,"user_id":5023,"question_id":200,"text":"","created_at":"2019-07-09 18:25:50 UTC","updated_at":"2019-07-09 18:25:50 UTC","archived":null,"plan_id":7719,"archived_by":null},{"id":1685,"user_id":5023,"question_id":201,"text":"","created_at":"2019-07-09 18:25:51 UTC","updated_at":"2019-07-09 18:25:51 UTC","archived":null,"plan_id":7719,"archived_by":null},{"id":1686,"user_id":5023,"question_id":202,"text":"","created_at":"2019-07-09 18:25:51 UTC","updated_at":"2019-07-09 18:25:51 UTC","archived":null,"plan_id":7719,"archived_by":null},{"id":1687,"user_id":8993,"question_id":196,"text":"","created_at":"2019-07-11 18:26:28 UTC","updated_at":"2019-07-11 18:26:28 UTC","archived":null,"plan_id":7726,"archived_by":null},{"id":1688,"user_id":8993,"question_id":194,"text":"","created_at":"2019-07-11 18:26:28 UTC","updated_at":"2019-07-11 18:26:28 UTC","archived":null,"plan_id":7726,"archived_by":null},{"id":1689,"user_id":8616,"question_id":351,"text":"","created_at":"2019-07-11 21:32:30 UTC","updated_at":"2019-07-11 21:32:30 UTC","archived":null,"plan_id":7529,"archived_by":null},{"id":1690,"user_id":5315,"question_id":194,"text":"","created_at":"2019-07-15 14:23:09 UTC","updated_at":"2019-07-15 14:23:09 UTC","archived":null,"plan_id":7731,"archived_by":null},{"id":1691,"user_id":5315,"question_id":194,"text":"","created_at":"2019-07-15 14:23:09 UTC","updated_at":"2019-07-15 14:23:09 UTC","archived":null,"plan_id":7731,"archived_by":null},{"id":1692,"user_id":5315,"question_id":196,"text":"","created_at":"2019-07-15 14:23:09 UTC","updated_at":"2019-07-15 14:23:09 UTC","archived":null,"plan_id":7731,"archived_by":null},{"id":1693,"user_id":5315,"question_id":197,"text":"<p>What other documents do we need?</p>","created_at":"2019-07-15 14:25:57 UTC","updated_at":"2019-07-15 14:25:57 UTC","archived":null,"plan_id":7731,"archived_by":null},{"id":1694,"user_id":5315,"question_id":197,"text":"<p>What other documents do we need?</p>","created_at":"2019-07-15 14:26:00 UTC","updated_at":"2019-07-15 14:26:00 UTC","archived":null,"plan_id":7731,"archived_by":null},{"id":1695,"user_id":9011,"question_id":205,"text":"<p>Certaines des informations me paraissent contradictoires</p>\r\n<p>Il est dit ici que &laquo;Les donn&eacute;es brutes et trait&eacute;es seront partag&eacute;es uniquement au sein de l'&eacute;quipe de recherche ..&raquo;</p>\r\n<p>N&eacute;anmoins, dans la section &laquo;Conformit&eacute; aux lois...&raquo;, on mentionne &laquo;Le consentement sera recueilli aupr&egrave;s des participants et ceux-ci seront avis&eacute;s que d'autres personnes autres que les co-chercheur(e)s pourront utiliser leurs donn&eacute;es compl&egrave;tement anonymes pour d'autres analyses reli&eacute;es au projet ou pour l'&eacute;laboration de projets futurs&raquo;; de m&ecirc;me que &laquo;...il sera possible de r&eacute;utiliser les donn&eacute;es puisque les participants y auront consentis avant de participer j&agrave; la collecte de donn&eacute;es. Cette r&eacute;utilisation doit &ecirc;tre approuv&eacute;e par la chercheure principale.&raquo;</p>\r\n<p>Y aura-t-il ou non partage des donn&eacute;es pour des projets futurs? Si oui, sous quelle forme?</p>","created_at":"2019-07-17 18:49:51 UTC","updated_at":"2019-07-17 19:00:11 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1696,"user_id":9011,"question_id":207,"text":"<p>Je comprends qu'il n'y aura donc pas d'accessibilit&eacute; aux donn&eacute;es en dehors des r&eacute;sultats pr&eacute;sent&eacute;s dans les publications.</p>","created_at":"2019-07-17 18:52:11 UTC","updated_at":"2019-07-17 18:52:11 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1697,"user_id":9011,"question_id":211,"text":"<p>Il faudrait sp&eacute;cifier la forme sous laquelle les donn&eacute;es pourraient &ecirc;tre partag&eacute;es (en conformit&eacute; avec la section &laquo;Paratage et r&eacute;utilisation&raquo; cela semble &ecirc;tre des donn&eacute;es d&eacute;finitives).</p>\r\n<p>Dans le cas o&ugrave; on envisage une utilisation secondaire des donn&eacute;es, il faudrait pr&eacute;ciser&nbsp;cette phrase &laquo;Les donn&eacute;es seront archiv&eacute;es pendant 7 ans apr&egrave;s la derni&egrave;re publication scientifique.&raquo; afin de savoir si c'est la derni&egrave;re publication en lien avec le projet initial ou celle en lien avec les autres projets.</p>\r\n<p>Enfin, en situation d'utilisation secondaire des donn&eacute;es, la p&eacute;riode de conservation de 7 ans peut &ecirc;tre revue &agrave; la hausse et les donn&eacute;es peuvent &ecirc;tre conserv&eacute;es pendant plus longtemps surtout si elles sont anonymes et que le risque de r&eacute;identification est pratiquement nulle.</p>","created_at":"2019-07-17 19:20:44 UTC","updated_at":"2019-07-17 19:20:44 UTC","archived":null,"plan_id":7635,"archived_by":null},{"id":1698,"user_id":7038,"question_id":538,"text":"","created_at":"2019-07-18 17:26:15 UTC","updated_at":"2019-07-18 17:26:15 UTC","archived":null,"plan_id":7735,"archived_by":null},{"id":1699,"user_id":7038,"question_id":539,"text":"","created_at":"2019-07-18 17:26:15 UTC","updated_at":"2019-07-18 17:26:15 UTC","archived":null,"plan_id":7735,"archived_by":null},{"id":1700,"user_id":7038,"question_id":403,"text":"","created_at":"2019-07-18 19:42:26 UTC","updated_at":"2019-07-18 19:42:26 UTC","archived":null,"plan_id":7737,"archived_by":null},{"id":1701,"user_id":7038,"question_id":403,"text":"","created_at":"2019-07-18 19:42:26 UTC","updated_at":"2019-07-18 19:42:26 UTC","archived":null,"plan_id":7737,"archived_by":null},{"id":1702,"user_id":7857,"question_id":403,"text":"","created_at":"2019-07-19 20:14:09 UTC","updated_at":"2019-07-19 20:14:56 UTC","archived":1,"plan_id":7155,"archived_by":7857},{"id":1703,"user_id":7857,"question_id":535,"text":"","created_at":"2019-07-19 20:24:15 UTC","updated_at":"2019-07-19 20:24:15 UTC","archived":null,"plan_i