ull},{"id":2100,"user_id":9635,"question_id":194,"text":"<p>What are the data sources and the projects? Are they related to a paper?</p>","created_at":"2019-10-23 15:52:04 UTC","updated_at":"2019-10-23 15:52:04 UTC","archived":null,"plan_id":8261,"archived_by":null},{"id":2101,"user_id":9635,"question_id":194,"text":"<p>What are the data sources and the projects? Are they related to a paper?</p>","created_at":"2019-10-23 15:52:04 UTC","updated_at":"2019-10-23 15:52:04 UTC","archived":null,"plan_id":8261,"archived_by":null},{"id":2102,"user_id":9706,"question_id":194,"text":"<p>Though you did mention the instrument you will use, I think it would be ideal to highlight what data this specific instrument is going to collect - I am assuming it is used to collected soil characteristics from samples but then again, I am not sure so maybe adding this bit of information would be informative.&nbsp;</p>","created_at":"2019-10-23 15:53:11 UTC","updated_at":"2019-10-23 15:53:11 UTC","archived":null,"plan_id":8171,"archived_by":null},{"id":2103,"user_id":9635,"question_id":196,"text":"<p>Might want to include underscores for the naming and avoid wordy descriptions. Eg. Reanalysis_LTS.R</p>","created_at":"2019-10-23 15:54:39 UTC","updated_at":"2019-10-23 15:54:39 UTC","archived":null,"plan_id":8261,"archived_by":null},{"id":2104,"user_id":9706,"question_id":195,"text":"<p>Can this data be reused? I assume it can be shared and there will be long-term access to the data but explaining if it will be shared and stored for long-term access is something you could add to this question.&nbsp;</p>","created_at":"2019-10-23 15:55:49 UTC","updated_at":"2019-10-23 15:55:49 UTC","archived":null,"plan_id":8171,"archived_by":null},{"id":2105,"user_id":9635,"question_id":197,"text":"<p>*changed Gituhb to Github.&nbsp;</p>\r\n<p>*changed requrired to required</p>","created_at":"2019-10-23 15:56:39 UTC","updated_at":"2019-10-23 15:56:39 UTC","archived":null,"plan_id":8261,"archived_by":null},{"id":2106,"user_id":9635,"question_id":200,"text":"<p>Approximately how many gigabyes? How big are the data that goes in the network? If it's collected every year/time period how big are the collected files?&nbsp;</p>","created_at":"2019-10-23 16:09:26 UTC","updated_at":"2019-10-23 16:09:26 UTC","archived":null,"plan_id":8261,"archived_by":null},{"id":2107,"user_id":9635,"question_id":205,"text":"<p>What forms will be the data in? Eg. shape file, csv</p>","created_at":"2019-10-23 16:18:20 UTC","updated_at":"2019-10-23 16:18:20 UTC","archived":null,"plan_id":8261,"archived_by":null},{"id":2108,"user_id":9729,"question_id":194,"text":"","created_at":"2019-10-23 16:41:38 UTC","updated_at":"2019-10-23 16:41:38 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2109,"user_id":7025,"question_id":537,"text":"","created_at":"2019-10-23 19:25:31 UTC","updated_at":"2019-10-23 19:25:31 UTC","archived":null,"plan_id":8269,"archived_by":null},{"id":2110,"user_id":7025,"question_id":539,"text":"","created_at":"2019-10-23 19:28:42 UTC","updated_at":"2019-10-23 19:28:42 UTC","archived":null,"plan_id":8269,"archived_by":null},{"id":2111,"user_id":7025,"question_id":538,"text":"","created_at":"2019-10-23 19:28:42 UTC","updated_at":"2019-10-23 19:28:42 UTC","archived":null,"plan_id":8269,"archived_by":null},{"id":2112,"user_id":9729,"question_id":198,"text":"","created_at":"2019-10-23 21:10:06 UTC","updated_at":"2019-10-23 21:10:06 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2113,"user_id":9729,"question_id":199,"text":"","created_at":"2019-10-23 21:10:07 UTC","updated_at":"2019-10-23 21:10:07 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2114,"user_id":9729,"question_id":208,"text":"","created_at":"2019-10-23 23:41:27 UTC","updated_at":"2019-10-23 23:41:27 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2115,"user_id":9729,"question_id":209,"text":"","created_at":"2019-10-23 23:41:30 UTC","updated_at":"2019-10-23 23:41:30 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2116,"user_id":9729,"question_id":210,"text":"","created_at":"2019-10-23 23:41:37 UTC","updated_at":"2019-10-23 23:41:37 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2117,"user_id":10018,"question_id":195,"text":"","created_at":"2019-10-24 15:24:04 UTC","updated_at":"2019-10-24 15:24:04 UTC","archived":null,"plan_id":8292,"archived_by":null},{"id":2118,"user_id":10018,"question_id":195,"text":"","created_at":"2019-10-24 15:24:04 UTC","updated_at":"2019-10-24 15:24:04 UTC","archived":null,"plan_id":8292,"archived_by":null},{"id":2119,"user_id":10018,"question_id":196,"text":"","created_at":"2019-10-24 15:24:04 UTC","updated_at":"2019-11-05 16:45:53 UTC","archived":1,"plan_id":8292,"archived_by":10018},{"id":2120,"user_id":10003,"question_id":195,"text":"","created_at":"2019-10-24 15:24:33 UTC","updated_at":"2019-10-24 15:24:33 UTC","archived":null,"plan_id":8294,"archived_by":null},{"id":2121,"user_id":10003,"question_id":196,"text":"","created_at":"2019-10-24 15:24:34 UTC","updated_at":"2019-10-24 15:24:34 UTC","archived":null,"plan_id":8294,"archived_by":null},{"id":2122,"user_id":10003,"question_id":195,"text":"","created_at":"2019-10-24 15:24:34 UTC","updated_at":"2019-10-24 15:24:34 UTC","archived":null,"plan_id":8294,"archived_by":null},{"id":2123,"user_id":9911,"question_id":521,"text":"","created_at":"2019-10-24 21:14:59 UTC","updated_at":"2019-10-24 21:14:59 UTC","archived":null,"plan_id":8254,"archived_by":null},{"id":2124,"user_id":9911,"question_id":522,"text":"","created_at":"2019-10-24 21:15:00 UTC","updated_at":"2019-10-24 21:15:00 UTC","archived":null,"plan_id":8254,"archived_by":null},{"id":2125,"user_id":9911,"question_id":522,"text":"","created_at":"2019-10-24 21:15:01 UTC","updated_at":"2019-10-24 21:15:01 UTC","archived":null,"plan_id":8254,"archived_by":null},{"id":2126,"user_id":10013,"question_id":196,"text":"<p>Do you need to have the version date in the file name? This could become cumbersom, and it would be better to use V1, V2, etc. (think if you are building a file over several days). Keep in mind too that the the date will be recorded when you save it.&nbsp;</p>","created_at":"2019-10-24 22:52:47 UTC","updated_at":"2019-10-24 22:52:47 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2127,"user_id":10013,"question_id":196,"text":"<p>Do you need to have the version date in the file name? This could become cumbersom, and it would be better to use V1, V2, etc. (think if you are building a file over several days). Keep in mind too that the the date will be recorded when you save it.&nbsp;</p>","created_at":"2019-10-24 22:52:47 UTC","updated_at":"2019-10-24 22:52:47 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2128,"user_id":10013,"question_id":197,"text":"<p>Will there be a data dictionary?</p>\r\n<p>As the data is manipulated, you will also want to keep notes on decisions made (ie., if variables are defined, recoded, user-made, etc.)</p>","created_at":"2019-10-24 22:54:42 UTC","updated_at":"2019-10-24 22:54:42 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2129,"user_id":10013,"question_id":197,"text":"<p>Will there be a data dictionary?</p>\r\n<p>As the data is manipulated, you will also want to keep notes on decisions made (ie., if variables are defined, recoded, user-made, etc.)</p>","created_at":"2019-10-24 22:54:42 UTC","updated_at":"2019-10-24 22:54:42 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2130,"user_id":10013,"question_id":201,"text":"<p>We will be working with a file server which will hold the original data file and versions. The computer that is used to manipulate the data will have a firewall, antivirus, disk encryption, and browser security.&nbsp;</p>","created_at":"2019-10-24 22:58:55 UTC","updated_at":"2019-10-24 22:58:55 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2131,"user_id":10013,"question_id":201,"text":"<p>We will be working with a file server which will hold the original data file and versions. The computer that is used to manipulate the data will have a firewall, antivirus, disk encryption, and browser security.&nbsp;</p>","created_at":"2019-10-24 22:58:55 UTC","updated_at":"2019-10-30 20:54:45 UTC","archived":1,"plan_id":8217,"archived_by":9729},{"id":2132,"user_id":10013,"question_id":202,"text":"<p>See previous note regarding holding the data on a server. Like you note, this will only be accessible by the researchrs.&nbsp;</p>","created_at":"2019-10-24 23:00:43 UTC","updated_at":"2019-10-24 23:00:43 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2133,"user_id":10013,"question_id":202,"text":"<p>See previous note regarding holding the data on a server. Like you note, this will only be accessible by the researchrs.&nbsp;</p>","created_at":"2019-10-24 23:00:43 UTC","updated_at":"2019-10-30 20:34:02 UTC","archived":1,"plan_id":8217,"archived_by":9729},{"id":2134,"user_id":10013,"question_id":204,"text":"<p>I\"m not sure how this fits with the previous response where you indicated it would not be preserved. Based on our ethics permission, we must destroy the data at the end of the project.&nbsp;</p>","created_at":"2019-10-24 23:04:09 UTC","updated_at":"2019-10-24 23:04:09 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2135,"user_id":10013,"question_id":204,"text":"<p>I\"m not sure how this fits with the previous response where you indicated it would not be preserved. Based on our ethics permission, we must destroy the data at the end of the project.&nbsp;</p>","created_at":"2019-10-24 23:04:09 UTC","updated_at":"2019-10-24 23:04:09 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2136,"user_id":10013,"question_id":205,"text":"<p>One option might be to indicate data can be shared (with PI's permissoin), but all personal identification will be stripped from the (residential location, work location, etc.)</p>","created_at":"2019-10-24 23:06:29 UTC","updated_at":"2019-10-24 23:06:29 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2137,"user_id":10013,"question_id":205,"text":"<p>One option might be to indicate data can be shared (with PI's permissoin), but all personal identification will be stripped from the (residential location, work location, etc.)</p>","created_at":"2019-10-24 23:06:29 UTC","updated_at":"2019-10-24 23:06:29 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2138,"user_id":10013,"question_id":209,"text":"<p>You can also indicate that the PI will identify other members of the research team to handle data administration.&nbsp;</p>","created_at":"2019-10-24 23:08:16 UTC","updated_at":"2019-10-24 23:08:16 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2139,"user_id":10013,"question_id":209,"text":"<p>You can also indicate that the PI will identify other members of the research team to handle data administration.&nbsp;</p>","created_at":"2019-10-24 23:08:16 UTC","updated_at":"2019-10-24 23:08:16 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2140,"user_id":10013,"question_id":211,"text":"<p>There will be no paper based surveys (at least in this phase). All data will be stored on a server as noted. You should note here that confidential information will not be released.&nbsp;</p>","created_at":"2019-10-24 23:10:45 UTC","updated_at":"2019-10-24 23:10:45 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2141,"user_id":10013,"question_id":211,"text":"<p>There will be no paper based surveys (at least in this phase). All data will be stored on a server as noted. You should note here that confidential information will not be released.&nbsp;</p>","created_at":"2019-10-24 23:10:45 UTC","updated_at":"2019-10-24 23:10:45 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2142,"user_id":9881,"question_id":205,"text":"<p>Can the transcripts be shared? If they don`t have identification, can they be accessed by asking you permission? In this case, I think you can share this data but with limited access.&nbsp;<br />Do you know the format of your analyzed and final data?&nbsp;</p>","created_at":"2019-10-25 15:03:42 UTC","updated_at":"2019-10-25 15:03:42 UTC","archived":null,"plan_id":8069,"archived_by":null},{"id":2143,"user_id":9881,"question_id":205,"text":"<p>Can the transcripts be shared? If they don`t have identification, can they be accessed by asking you permission? In this case, I think you can share this data but with limited access.&nbsp;<br />Do you know the format of your analyzed and final data?&nbsp;</p>","created_at":"2019-10-25 15:03:42 UTC","updated_at":"2019-10-25 15:03:42 UTC","archived":null,"plan_id":8069,"archived_by":null},{"id":2144,"user_id":9881,"question_id":206,"text":"<p>In your case, I think an end-user license could be a good idea in order to share your transcript data.&nbsp;</p>","created_at":"2019-10-25 15:07:25 UTC","updated_at":"2019-10-25 15:07:25 UTC","archived":null,"plan_id":8069,"archived_by":null},{"id":2145,"user_id":9881,"question_id":206,"text":"<p>In your case, I think an end-user license could be a good idea in order to share your transcript data.&nbsp;</p>","created_at":"2019-10-25 15:07:25 UTC","updated_at":"2019-10-25 15:07:25 UTC","archived":null,"plan_id":8069,"archived_by":null},{"id":2146,"user_id":9844,"question_id":535,"text":"","created_at":"2019-10-25 15:13:12 UTC","updated_at":"2019-10-25 15:13:12 UTC","archived":null,"plan_id":8215,"archived_by":null},{"id":2147,"user_id":9844,"question_id":536,"text":"","created_at":"2019-10-25 15:13:12 UTC","updated_at":"2019-10-25 15:13:12 UTC","archived":null,"plan_id":8215,"archived_by":null},{"id":2148,"user_id":9881,"question_id":207,"text":"<p>You are probably publishing a paper about your research. I understand that this is a step that will let the research community know that your data exists. You may don't want to share it, but you can let people know that it exists.</p>","created_at":"2019-10-25 15:20:35 UTC","updated_at":"2019-10-25 15:20:35 UTC","archived":null,"plan_id":8069,"archived_by":null},{"id":2149,"user_id":9881,"question_id":207,"text":"<p>You are probably publishing a paper about your research. I understand that this is a step that will let the research community know that your data exists. You may don't want to share it, but you can let people know that it exists.</p>","created_at":"2019-10-25 15:20:35 UTC","updated_at":"2019-10-25 15:20:35 UTC","archived":null,"plan_id":8069,"archived_by":null},{"id":2150,"user_id":9636,"question_id":194,"text":"<p>I think that this is substantive and likely comprehensive of the data you are accessing, but what about data outputs? There is a mixture of GIS-type data, but no mention of what that data will be synthesized into. E.g., will thematic boundary information be created by analyzing the RSdata for built environments and then joined with road data to develop some sort of temporal analysis of boundary changes? Also, have you considered the landsat data from the usgs?</p>","created_at":"2019-10-25 15:42:08 UTC","updated_at":"2019-10-25 15:42:08 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2151,"user_id":9636,"question_id":195,"text":"<p>I have limited working familiarity with the Europa RS data, but I believe these are often outputted as jpegs or similar formats.</p>","created_at":"2019-10-25 15:44:20 UTC","updated_at":"2019-10-25 15:44:20 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2152,"user_id":9636,"question_id":196,"text":"<p>How will the raw and processed data be managed? Often multiple iterations of data outputs are generated before a final modelling output is felt or determined to be correct? Will it be the same versioning as the data name?</p>","created_at":"2019-10-25 15:46:02 UTC","updated_at":"2019-10-25 15:46:02 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2153,"user_id":9636,"question_id":197,"text":"<p>Not knowing anything about your study, will there be documentation to outline what the objective of the project is and why the selected data is necessary?&nbsp;</p>\r\n<p>Will the metadata include the steps that outline how the data was prepared and cleaned for analysis, the specific tools and methods used to conduct the analysis, and what challenges might be encountered if trying to replicate your results? Will it also identify which attributes within each dataset were used, the RS imagery bands used, and the programs to conduct the analysis?&nbsp;</p>","created_at":"2019-10-25 15:50:43 UTC","updated_at":"2019-10-25 15:50:43 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2154,"user_id":9636,"question_id":198,"text":"<p>May be worthwhile to address this question.</p>\r\n<p>Will files be stored in GitHub to ensure completness of documentation? Will a short white paper be written on the methods of the data prep and analysis? Etc.</p>","created_at":"2019-10-25 15:53:11 UTC","updated_at":"2019-10-25 15:53:11 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2155,"user_id":9636,"question_id":200,"text":"<p>How large is the data set? Depending on the amount of imagery you are using, I would guess this to be in the low GB range.</p>","created_at":"2019-10-25 15:54:53 UTC","updated_at":"2019-10-25 15:54:53 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2156,"user_id":9636,"question_id":201,"text":"<p>You have identified an offsite copy, multiple copies of the data, and different mediums which is good. Perhaps a copy stored on an external HD or the external backup drives of the computers would be appropriate to minimize the potential for data loss.</p>","created_at":"2019-10-25 15:57:13 UTC","updated_at":"2019-10-25 15:57:13 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2157,"user_id":9636,"question_id":202,"text":"<p>Since you are not working with confidential data, this is likely sufficient and there is minimal concern about sending information across emails. Should collaborators wish to edit or otherwise modify the project data, would it need to be changed on your computers, or would they have access to the remote copy and be able to make changes from there? Similarily, how would they contribute to the data?</p>","created_at":"2019-10-25 15:59:46 UTC","updated_at":"2019-10-25 15:59:46 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2158,"user_id":9636,"question_id":203,"text":"<p>Depending on the size of your data, you may exceed the account size of GitHub (1 GB), if this is the case, how long will that data be stored (5 years was mentioned) and who will pay those account fees? How will a original copy of the data be kept - on the researcher's personal computer, the supervisors, or somewhere else?</p>","created_at":"2019-10-25 16:02:31 UTC","updated_at":"2019-10-25 16:02:31 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2159,"user_id":9636,"question_id":204,"text":"<p>It may be worth noting that your file formats are already likely preservation friendly. I believe shapefiles can be read by most non-ESRI programs include open software packages like R.</p>","created_at":"2019-10-25 16:04:43 UTC","updated_at":"2019-10-25 16:04:43 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2160,"user_id":9636,"question_id":205,"text":"<p>In this consideration, is it your right to share the raw or processed outputs of data that you yourself have not collected? There may be usage restrictions depending on who formally owns the data. While as academics we often have broad access to otherwise very expensive data, we often do not have the right to share copies of the origina datasets. Might be worth looking into the EULA's for the datasets mentioned.</p>","created_at":"2019-10-25 16:07:49 UTC","updated_at":"2019-10-25 16:07:49 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2161,"user_id":9636,"question_id":206,"text":"<p>I think this feeds in well with the previous point about who owns the data and who has the right to determine what the eula actually needs to be.</p>","created_at":"2019-10-25 16:10:08 UTC","updated_at":"2019-10-25 16:10:08 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2162,"user_id":9636,"question_id":207,"text":"<p>This seems reasonable and sufficient.</p>","created_at":"2019-10-25 16:10:52 UTC","updated_at":"2019-10-25 16:10:52 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2163,"user_id":9636,"question_id":208,"text":"<p>What is the timeframe associated with the responsibilities? Five years was mentioned, after the completion of grad or phd work, who then manages the data?</p>","created_at":"2019-10-25 16:12:37 UTC","updated_at":"2019-10-25 16:12:37 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2164,"user_id":9636,"question_id":209,"text":"<p>Might be worth noting that the metadata mentioned in early sections, as well as the overview documentation, would be very helpful in ensuring a smooth transition to a different primary or different researcher.</p>","created_at":"2019-10-25 16:14:09 UTC","updated_at":"2019-10-25 16:14:09 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2165,"user_id":9636,"question_id":210,"text":"<p>This seems reasonable and sufficient.</p>","created_at":"2019-10-25 16:14:49 UTC","updated_at":"2019-10-25 16:14:49 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2166,"user_id":9636,"question_id":213,"text":"<p>In some respects, this may go back to the issue of who owns the data and given any generated outputs from that data, who is the owner of the IP? Is it the data owner, is it you as the reseachers, or is the institution which is paying all of the fees? Or some other 3rd-party?</p>","created_at":"2019-10-25 16:16:34 UTC","updated_at":"2019-10-25 16:16:34 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2167,"user_id":9881,"question_id":200,"text":"<p>I have no idea about the size of the data. I began to collect the data this week, so maybe in the following weeks, I will have an idea.&nbsp;</p>","created_at":"2019-10-25 16:37:16 UTC","updated_at":"2019-10-25 16:37:16 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2168,"user_id":9881,"question_id":200,"text":"<p>I have no idea about the size of the data. I began to collect the data this week, so maybe in the following weeks, I will have an idea.&nbsp;</p>","created_at":"2019-10-25 16:37:16 UTC","updated_at":"2019-10-25 16:37:16 UTC","archived":null,"plan_id":8204,"archived_by":null},{"id":2169,"user_id":10032,"question_id":539,"text":"","created_at":"2019-10-25 18:57:49 UTC","updated_at":"2019-10-25 18:57:49 UTC","archived":null,"plan_id":8300,"archived_by":null},{"id":2170,"user_id":10032,"question_id":538,"text":"","created_at":"2019-10-25 18:57:49 UTC","updated_at":"2019-10-25 18:57:49 UTC","archived":null,"plan_id":8300,"archived_by":null},{"id":2171,"user_id":9454,"question_id":19,"text":"","created_at":"2019-10-25 22:07:35 UTC","updated_at":"2019-10-25 22:07:35 UTC","archived":null,"plan_id":7953,"archived_by":null},{"id":2172,"user_id":9454,"question_id":2,"text":"","created_at":"2019-10-25 22:07:36 UTC","updated_at":"2019-10-25 22:07:36 UTC","archived":null,"plan_id":7953,"archived_by":null},{"id":2173,"user_id":9454,"question_id":20,"text":"","created_at":"2019-10-25 22:07:36 UTC","updated_at":"2019-10-25 22:07:36 UTC","archived":null,"plan_id":7953,"archived_by":null},{"id":2174,"user_id":9645,"question_id":195,"text":"<p>Excel is definitely accessible at present, since it can be opened by open-source programs.</p>","created_at":"2019-10-27 00:15:40 UTC","updated_at":"2019-10-27 00:15:40 UTC","archived":null,"plan_id":8167,"archived_by":null},{"id":2175,"user_id":9645,"question_id":213,"text":"<p>This probably needs to involve the university, they need to have a policy in place.</p>","created_at":"2019-10-27 01:11:09 UTC","updated_at":"2019-10-27 01:11:09 UTC","archived":null,"plan_id":8167,"archived_by":null},{"id":2176,"user_id":9645,"question_id":201,"text":"<p>what cloud in particular, and do you know that the service is secure?</p>","created_at":"2019-10-27 01:13:29 UTC","updated_at":"2019-10-27 01:13:29 UTC","archived":null,"plan_id":8167,"archived_by":null},{"id":2177,"user_id":9645,"question_id":203,"text":"<p>the anonymized data can be shared, but not personally identifying data, right?</p>","created_at":"2019-10-27 01:18:25 UTC","updated_at":"2019-10-27 01:18:25 UTC","archived":null,"plan_id":8167,"archived_by":null},{"id":2178,"user_id":9645,"question_id":204,"text":"<p>May want to ensure that you save as .xls, and not as .xlsx, as long as your data doesn't require specific .xlsx features?</p>","created_at":"2019-10-27 01:20:34 UTC","updated_at":"2019-10-27 01:20:34 UTC","archived":null,"plan_id":8167,"archived_by":null},{"id":2179,"user_id":9729,"question_id":196,"text":"<p>Can you please include some details on file naming (not versions)? Like how you will name the files.</p>","created_at":"2019-10-27 04:29:45 UTC","updated_at":"2019-10-27 04:29:45 UTC","archived":null,"plan_id":8238,"archived_by":null},{"id":2180,"user_id":9729,"question_id":200,"text":"<p>Is there any confidential data? If yes, would that be good idea to store them in personal drives or in cloud?</p>","created_at":"2019-10-27 04:35:05 UTC","updated_at":"2019-10-27 04:35:05 UTC","archived":null,"plan_id":8238,"archived_by":null},{"id":2181,"user_id":9729,"question_id":205,"text":"<p>That's a really great plan. But how you will manage all these versions without creating confusions?</p>","created_at":"2019-10-27 04:39:31 UTC","updated_at":"2019-10-27 04:39:31 UTC","archived":null,"plan_id":8238,"archived_by":null},{"id":2182,"user_id":9729,"question_id":207,"text":"<p>Do users need permission to reuse the data?</p>","created_at":"2019-10-27 04:40:50 UTC","updated_at":"2019-10-27 04:40:50 UTC","archived":null,"plan_id":8238,"archived_by":null},{"id":2183,"user_id":9729,"question_id":208,"text":"<p>Who will assign roles?</p>","created_at":"2019-10-27 04:42:54 UTC","updated_at":"2019-10-27 04:42:54 UTC","archived":null,"plan_id":8238,"archived_by":null},{"id":2184,"user_id":9645,"question_id":200,"text":"","created_at":"2019-10-27 11:59:41 UTC","updated_at":"2019-10-27 11:59:41 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2185,"user_id":9645,"question_id":202,"text":"","created_at":"2019-10-27 11:59:41 UTC","updated_at":"2019-10-27 11:59:41 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2186,"user_id":9645,"question_id":211,"text":"<p>I'd think there is a framework that already exists for handling sensitive patient data. Maybe place a reference to it here?</p>","created_at":"2019-10-27 12:42:15 UTC","updated_at":"2019-10-27 12:42:15 UTC","archived":null,"plan_id":8167,"archived_by":null},{"id":2187,"user_id":9645,"question_id":205,"text":"<p>The \"analyzed data\" and \"final data\" sections under Guidance, I think, give you the option for talking about extra things. E.g., if you have a huge dataset, you can still share a graph of it; and your \"final data\" is all the stuff you include in your final report.</p>","created_at":"2019-10-27 13:32:01 UTC","updated_at":"2019-10-27 13:32:01 UTC","archived":null,"plan_id":8167,"archived_by":null},{"id":2188,"user_id":9958,"question_id":201,"text":"<p>Maybe a bit more specific, how will the data be stored on these computers (subdirectory/folder etc.).</p>","created_at":"2019-10-27 16:01:23 UTC","updated_at":"2019-10-30 20:54:45 UTC","archived":1,"plan_id":8217,"archived_by":9729},{"id":2189,"user_id":9958,"question_id":203,"text":"<p>I don't know if this it too much to ask, but how will the data be destroyed? Are there specific guidelines/criteria that need to be followed to ensure that data is completely deleted?&nbsp;</p>","created_at":"2019-10-27 16:05:09 UTC","updated_at":"2019-10-27 16:05:09 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2190,"user_id":9958,"question_id":207,"text":"<p>Are there multiple journal articles that the data will be featured in? Or will there be one that this is intended for?</p>","created_at":"2019-10-27 16:09:17 UTC","updated_at":"2019-10-27 16:09:17 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2191,"user_id":9958,"question_id":208,"text":"<p>Will there be a specific team member that will be assigned to this in the future (i.e. future graduate student?)</p>","created_at":"2019-10-27 16:13:02 UTC","updated_at":"2019-10-27 16:13:02 UTC","archived":null,"plan_id":8217,"archived_by":null},{"id":2192,"user_id":9672,"question_id":194,"text":"<p>Looks good, you have many different types of data listed which is great.</p>","created_at":"2019-10-28 13:26:58 UTC","updated_at":"2019-10-28 13:26:58 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2193,"user_id":9672,"question_id":196,"text":"<p>Maybe describe the format that was used in the session 7 notes? Once you have the files divided by years how do you pan to name each file that is saved in this folder? (may or may not apply to the kind of data you work with)</p>\r\n<p>For example: files will be named as followed: Name_Project Descriptor_Version_Date Created</p>\r\n<p>&nbsp;</p>","created_at":"2019-10-28 13:34:38 UTC","updated_at":"2019-10-28 13:34:38 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2194,"user_id":9672,"question_id":197,"text":"<p>Looks good, only if applicable I would also add then a note on how the data itself can be easily interpreted by a reader. data may be eaasy for you to interpret and read but more complexe data may use terms and be structured in such a way that someone who was unfamiliar with your data may struggle.</p>\r\n<p>If there is a way to prevent this please explain.</p>","created_at":"2019-10-28 13:38:44 UTC","updated_at":"2019-10-28 13:38:44 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2195,"user_id":9672,"question_id":198,"text":"<p>Updated in which way? how will your documentation change with updates and how does this ensure consistancy?</p>","created_at":"2019-10-28 13:40:12 UTC","updated_at":"2019-10-28 13:40:12 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2196,"user_id":9672,"question_id":202,"text":"<p>If you are cloning or forking data how will you combine data contributed by collaborators into the data files that you are updating/creating?&nbsp;</p>","created_at":"2019-10-28 13:46:55 UTC","updated_at":"2019-10-28 13:46:55 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2197,"user_id":9672,"question_id":205,"text":"<p>I would maybe clarify what type of data each of the mentioned are. For example, would your R code be considered your raw data or is ti your processed data? etc.</p>","created_at":"2019-10-28 13:50:20 UTC","updated_at":"2019-10-28 13:50:20 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2198,"user_id":9672,"question_id":206,"text":"<p>will your data be published? may want to check if your data will also have licenses associated with where it is published.</p>","created_at":"2019-10-28 13:52:18 UTC","updated_at":"2019-10-28 13:52:18 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2199,"user_id":9672,"question_id":207,"text":"<p>will there be abything published at the end of your analysis on the data you have aquired?</p>\r\n<p>Will you be sharing your findings at the end of your project?</p>","created_at":"2019-10-28 13:56:01 UTC","updated_at":"2019-10-28 13:56:01 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2200,"user_id":9672,"question_id":208,"text":"<p>will there be any requirement for training individuals in the projec team in order for them to use your work and interpret the data?</p>","created_at":"2019-10-28 13:58:07 UTC","updated_at":"2019-10-28 13:58:07 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2201,"user_id":9672,"question_id":210,"text":"<p>any personal expenses involved? USB sticks, hard drives for data storage?</p>","created_at":"2019-10-28 14:00:10 UTC","updated_at":"2019-10-28 14:00:10 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2202,"user_id":9672,"question_id":213,"text":"<p>are there any legal restrictions put in place by the providers of the data?</p>","created_at":"2019-10-28 14:02:55 UTC","updated_at":"2019-10-28 14:02:55 UTC","archived":null,"plan_id":8235,"archived_by":null},{"id":2203,"user_id":10071,"question_id":545,"text":"","created_at":"2019-10-28 15:10:28 UTC","updated_at":"2019-10-28 15:10:28 UTC","archived":null,"plan_id":8329,"archived_by":null},{"id":2204,"user_id":9831,"question_id":194,"text":"","created_at":"2019-10-28 17:16:42 UTC","updated_at":"2019-10-28 17:16:42 UTC","archived":null,"plan_id":8220,"archived_by":null},{"id":2205,"user_id":9831,"question_id":194,"text":"","created_at":"2019-10-28 17:16:42 UTC","updated_at":"2019-10-28 17:16:42 UTC","archived":null,"plan_id":8220,"archived_by":null},{"id":2206,"user_id":9831,"question_id":195,"text":"","created_at":"2019-10-28 17:16:42 UTC","updated_at":"2019-10-28 17:16:42 UTC","archived":null,"plan_id":8220,"archived_by":null},{"id":2207,"user_id":9831,"question_id":196,"text":"","created_at":"2019-10-28 17:16:43 UTC","updated_at":"2019-10-28 17:16:43 UTC","archived":null,"plan_id":8220,"archived_by":null},{"id":2208,"user_id":10056,"question_id":273,"text":"","created_at":"2019-10-29 09:15:35 UTC","updated_at":"2019-10-29 09:15:35 UTC","archived":null,"plan_id":8320,"archived_by":null},{"id":2209,"user_id":10056,"question_id":275,"text":"","created_at":"2019-10-29 09:15:35 UTC","updated_at":"2019-10-29 09:15:35 UTC","archived":null,"plan_id":8320,"archived_by":null},{"id":2210,"user_id":10056,"question_id":272,"text":"","created_at":"2019-10-29 09:15:35 UTC","updated_at":"2019-10-29 09:15:35 UTC","archived":null,"plan_id":8320,"archived_by":null},{"id":2211,"user_id":10053,"question_id":195,"text":"","created_at":"2019-10-29 17:19:28 UTC","u