reated_at":"2020-03-16 20:26:25 UTC","updated_at":"2020-03-16 20:26:25 UTC","archived":null,"plan_id":8992,"archived_by":null},{"id":2646,"user_id":11809,"question_id":196,"text":"","created_at":"2020-03-16 20:26:25 UTC","updated_at":"2020-03-16 20:26:25 UTC","archived":null,"plan_id":8992,"archived_by":null},{"id":2647,"user_id":11826,"question_id":203,"text":"","created_at":"2020-03-18 17:27:59 UTC","updated_at":"2020-03-18 17:27:59 UTC","archived":null,"plan_id":8998,"archived_by":null},{"id":2648,"user_id":11826,"question_id":203,"text":"","created_at":"2020-03-18 17:27:59 UTC","updated_at":"2020-03-18 17:27:59 UTC","archived":null,"plan_id":8998,"archived_by":null},{"id":2649,"user_id":11826,"question_id":204,"text":"","created_at":"2020-03-18 17:27:59 UTC","updated_at":"2020-03-18 17:27:59 UTC","archived":null,"plan_id":8998,"archived_by":null},{"id":2650,"user_id":11624,"question_id":208,"text":"","created_at":"2020-03-20 23:37:50 UTC","updated_at":"2020-03-20 23:37:50 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2651,"user_id":11624,"question_id":210,"text":"","created_at":"2020-03-20 23:37:50 UTC","updated_at":"2020-03-20 23:37:50 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2652,"user_id":6332,"question_id":335,"text":"","created_at":"2020-03-31 21:01:40 UTC","updated_at":"2020-03-31 21:01:40 UTC","archived":null,"plan_id":6199,"archived_by":null},{"id":2653,"user_id":6332,"question_id":335,"text":"","created_at":"2020-03-31 21:01:40 UTC","updated_at":"2020-03-31 21:01:40 UTC","archived":null,"plan_id":6199,"archived_by":null},{"id":2654,"user_id":6332,"question_id":337,"text":"","created_at":"2020-03-31 21:01:40 UTC","updated_at":"2020-03-31 21:01:40 UTC","archived":null,"plan_id":6199,"archived_by":null},{"id":2655,"user_id":6332,"question_id":338,"text":"","created_at":"2020-03-31 21:01:40 UTC","updated_at":"2020-03-31 21:01:40 UTC","archived":null,"plan_id":6199,"archived_by":null},{"id":2656,"user_id":6332,"question_id":339,"text":"","created_at":"2020-03-31 21:01:41 UTC","updated_at":"2020-03-31 21:01:41 UTC","archived":null,"plan_id":6199,"archived_by":null},{"id":2657,"user_id":5257,"question_id":194,"text":"<p>Should add in the transcription (text) data as well. If there there are any data being created via analytic software, or code that is written, you can include that here too.</p>","created_at":"2020-04-01 17:04:13 UTC","updated_at":"2020-04-01 17:04:13 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2658,"user_id":5257,"question_id":195,"text":"<p>If adding the text (transription) data then can indicate the format here. You mentioned MSWord, which makes sense to work with, but for the longer term preservation those should be converted to. a non-proprieatary format, such as a basic .txt file.&nbsp;</p>","created_at":"2020-04-01 17:15:49 UTC","updated_at":"2020-04-01 17:15:49 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2659,"user_id":5257,"question_id":196,"text":"<p>We spoke about this one already on the call and think that you are on the right track here. A couple of suggestions, helpful to speak to the file versioning in a bit more detail (e.g., Raw, Master, Analytic - all as applicable) and also to have a date stamp.</p>","created_at":"2020-04-01 17:20:57 UTC","updated_at":"2020-04-01 17:20:57 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2660,"user_id":5257,"question_id":197,"text":"<p>This is where I additiaonlly recommend speaking to the development and implementation of a file naming convention protocol and crosswalk document - that will allow anyone to easily inderstand your file naming conventions and locate fles of interest across context and versions.&nbsp;</p>","created_at":"2020-04-01 17:22:47 UTC","updated_at":"2020-04-01 17:22:47 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2661,"user_id":5257,"question_id":198,"text":"<p>Similar to above, you could additionally speak to having a data collection protocol which includes a reference to the file naming documentation. Part of the data collection protocol can include when and how files are named, and also a file verification checking process.</p>","created_at":"2020-04-01 17:25:17 UTC","updated_at":"2020-04-01 17:25:17 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2662,"user_id":5257,"question_id":199,"text":"<p>At this stage I think it is fine to say that beyond the in-house file naming conventions you are also consulting with local metadata experts on campus to identify any established metadata standards that might optimally support your project.</p>","created_at":"2020-04-01 17:26:53 UTC","updated_at":"2020-04-01 17:26:53 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2663,"user_id":5257,"question_id":205,"text":"<p>We spoke a bit about this on the call, so this is just more to help remind and provide information. Google Drive (or Compute Canada's cloud environment if that ends up happening) is a solution for supporting the active phases of the research, but not for supporting the &nbsp;long term preservation, discovery, sharing and reuse of data. Goes back to the trusted digital repository and DOI's conversation that we had.&nbsp;</p>\r\n<p>Once it is determined what suports will be in place for sharing data with collaborators you can certainly indicate that. For the long term sharing of data I think it is ok to say that there are no plans to destroy any of the data and that you will look to deposit the processed data (and maybe the raw?) into a trusted digital repository such as e.g., Dataverse, ERC, FRDR, for long term preservation, discovery and acess, and that you will work with experts in the DIgital Initiatives area of the Library to help guide you during this process.</p>","created_at":"2020-04-01 17:59:58 UTC","updated_at":"2020-04-01 17:59:58 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2664,"user_id":5257,"question_id":206,"text":"<p>Similar to previous - can indicate that you will work with Library folks to help guide. I think likely though that you are looking at having an open CC-BY license from the sounds of things. See URL below for more information:</p>\r\n<p>&nbsp;</p>\r\n<p>https://creativecommons.org/licenses/by/2.0/ca/</p>\r\n<p>&nbsp;</p>","created_at":"2020-04-01 18:03:14 UTC","updated_at":"2020-04-01 18:03:14 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2665,"user_id":5257,"question_id":207,"text":"<p>Can revise this re: data repository, DOIs, etc. I can help refine it later with you if you'd like.</p>","created_at":"2020-04-01 18:04:09 UTC","updated_at":"2020-04-01 18:04:09 UTC","archived":null,"plan_id":8963,"archived_by":null},{"id":2666,"user_id":11743,"question_id":354,"text":"","created_at":"2020-04-07 21:19:45 UTC","updated_at":"2020-04-07 21:19:45 UTC","archived":null,"plan_id":9007,"archived_by":null},{"id":2667,"user_id":12140,"question_id":1,"text":"<p>Please edit and review</p>","created_at":"2020-04-08 20:08:43 UTC","updated_at":"2020-04-08 20:08:43 UTC","archived":null,"plan_id":9043,"archived_by":null},{"id":2668,"user_id":12140,"question_id":3,"text":"<p>Please review and edit.</p>","created_at":"2020-04-08 20:09:42 UTC","updated_at":"2020-04-08 20:09:42 UTC","archived":null,"plan_id":9043,"archived_by":null},{"id":2669,"user_id":12016,"question_id":207,"text":"","created_at":"2020-04-10 14:24:30 UTC","updated_at":"2020-04-10 14:24:30 UTC","archived":null,"plan_id":9021,"archived_by":null},{"id":2670,"user_id":6244,"question_id":544,"text":"","created_at":"2020-04-13 15:25:17 UTC","updated_at":"2020-04-13 15:25:17 UTC","archived":null,"plan_id":9050,"archived_by":null},{"id":2671,"user_id":6244,"question_id":545,"text":"<p>Are there other types data that will be collected?</p>","created_at":"2020-04-13 15:59:26 UTC","updated_at":"2020-04-23 02:54:53 UTC","archived":1,"plan_id":9050,"archived_by":6244},{"id":2672,"user_id":3451,"question_id":741,"text":"<p>test</p