t we need to work on, such as the mechanism for sharing data.&nbsp; At this time, we do not have a central data storage location for Module E data, but some possibilities include Google Drive, Dropbox, Network-Attached storage (Sue Ziegler), or a MUN-hosted FTP site.&nbsp; Progress to identify the best resources is on-going (SJ).</p>\r\n<p>&nbsp;</p>\r\n<p>Otherwise, great answer, Ben!</p>","created_at":"2020-06-09 15:42:56 UTC","updated_at":"2020-06-09 15:42:56 UTC","archived":null,"plan_id":9076,"archived_by":null},{"id":2812,"user_id":9778,"question_id":700,"text":"<p>Once we identify the best respository(-ies) for your data, we'll need to update this field with any costs anciticipate during data upload and archive in the repository.</p>","created_at":"2020-06-09 15:44:25 UTC","updated_at":"2020-06-09 15:44:25 UTC","archived":null,"plan_id":9076,"archived_by":null},{"id":2813,"user_id":9778,"question_id":702,"text":"<p>This looks GREAT, thank you for staying on top of file organization!&nbsp; I had more questions about the naming conventions, but you've anticipated that and already answered it in your next metadata question.</p>\r\n<p>Note: instrumentation documention for many repositories is LONG and comprehensive, so we'll want to be sure we have as much information about your equipment retained as we can.</p>","created_at":"2020-06-09 15:48:46 UTC","updated_at":"2020-06-09 15:50:26 UTC","archived":null,"plan_id":9076,"archived_by":null},{"id":2814,"user_id":9778,"question_id":704,"text":"<p>Is your R code something you've created, or will you be using someone else's code?&nbsp; If the former, will we want to document and share that code as well?</p>","created_at":"2020-06-09 15:51:30 UTC","updated_at":"2020-06-09 15:51:30 UTC","archived":null,"plan_id":9076,"archived_by":null},{"id":2815,"user_id":9778,"question_id":689,"text":"<p>I wanted to highlight the temp data; you've done an excellent job describing how you will organize, process, and store your video/tag data, but I didn't see any details about the temperature data in the \"data documentation and metadata\" section.</p>","created_at":"2020-06-09 15:54:08 UTC","updated_at":"2020-06-09 15:54:08 UTC","archived":null,"plan_id":9076,"archived_by":null},{"id":2816,"user_id":9778,"question_id":707,"text":"<p>We will need to discuss within your research group and Module E to determine what resources are available for collaborating in the short to medium-term.&nbsp; Please feel free to bug me about this as much as you need to.</p>","created_at":"2020-06-09 15:56:30 UTC","updated_at":"2020-06-09 15:56:30 UTC","archived":null,"plan_id":9076,"archived_by":null},{"id":2817,"user_id":9778,"question_id":709,"text":"<p>Ben, is your work coordinated with the Nunatsiavut Government science office?&nbsp; I'm not yet clear on agreements between OFI and NG in terms of IP/knowledge and sharing, but let's flag this for follow up.</p>","created_at":"2020-06-09 16:00:36 UTC","updated_at":"2020-06-09 16:00:36 UTC","archived":null,"plan_id":9076,"archived_by":null},{"id":2818,"user_id":9778,"question_id":689,"text":"<p>Thanks for getting started on this, Mary!&nbsp; If you could also edit the plan details to include a few sentence \"elevator-pitch\" style project description, it would definitely help the reader put your dataset descriptions and the rest of your responses into better context.</p>","created_at":"2020-06-09 16:05:47 UTC","updated_at":"2020-06-09 16:05:47 UTC","archived":null,"plan_id":9077,"archived_by":null},{"id":2819,"user_id":12915,"question_id":196,"text":"","created_at":"2020-06-09 16:10:24 UTC","updated_at":"2020-06-09 16:10:24 UTC","archived":null,"plan_id":9162,"archived_by":null},{"id":2820,"user_id":12915,"question_id":199,"text":"","created_at":"2020-06-09 19:02:36 UTC","updated_at":"2020-06-09 19:02:36 UTC","archived":null,"plan_id":9162,"archived_by":null},{"id":2821,"user_id":12915,"question_id":202,"text":"","created_at":"2020-06-09 19:47:28 UTC","updated_at":