llected data is not sensitive, however, we would have to check with the landowners if they mind that the gps locations of the sample sites are shared. If not, the coordinates linked to the cores can be removed; the data would still be valuable just not spatially.</p>","created_at":"2020-06-12 19:15:17 UTC","updated_at":"2020-06-12 19:15:17 UTC","archived":null,"plan_id":9279,"archived_by":null},{"id":2844,"user_id":13722,"question_id":8,"text":"<p>Unless the site locations are sensitive...</p>","created_at":"2020-06-12 20:00:23 UTC","updated_at":"2020-06-12 20:00:23 UTC","archived":null,"plan_id":9279,"archived_by":null},{"id":2845,"user_id":14573,"question_id":741,"text":"<p>I'm not really sure of the best way to do this - what do you think?</p>","created_at":"2020-06-15 13:32:52 UTC","updated_at":"2020-06-15 13:32:52 UTC","archived":null,"plan_id":9310,"archived_by":null},{"id":2846,"user_id":4133,"question_id":20,"text":"","created_at":"2020-06-15 18:31:11 UTC","updated_at":"2020-06-15 18:31:11 UTC","archived":null,"plan_id":3850,"archived_by":null},{"id":2847,"user_id":14583,"question_id":202,"text":"","created_at":"2020-06-16 20:32:12 UTC","updated_at":"2020-06-16 20:32:12 UTC","archived":null,"plan_id":9313,"archived_by":null},{"id":2848,"user_id":14619,"question_id":196,"text":"","created_at":"2020-06-16 23:36:53 UTC","updated_at":"2020-06-16 23:36:53 UTC","archived":null,"plan_id":9327,"archived_by":null},{"id":2849,"user_id":14544,"question_id":260,"text":"","created_at":"2020-06-17 00:39:26 UTC","updated_at":"2020-06-17 00:39:26 UTC","archived":null,"plan_id":9307,"archived_by":null},{"id":2850,"user_id":13722,"question_id":17,"text":"<p>Monireh &amp; Majid, I am assuming the dataset would stay with you.</p>","created_at":"2020-06-17 02:06:17 UTC","updated_at":"2020-06-17 02:06:17 UTC","archived":null,"plan_id":9279,"archived_by":null},{"id":2851,"user_id":14653,"question_id":197,"text":"","created_at":"2020-06-18 14:07:51 UTC","updated_at":"2020-06-18 14: