6,"user_id":15408,"question_id":210,"text":"","created_at":"2020-07-07 18:12:26 UTC","updated_at":"2020-07-07 18:12:26 UTC","archived":null,"plan_id":9436,"archived_by":null},{"id":2907,"user_id":4897,"question_id":196,"text":"<p><strong>Denote dates in YYYYMMDD format</strong></p>\r\n<p>BECAUSE: Computers sort YYYYMMDD in chronological order.</p>\r\n<p><strong>Use a short unique identifier (e.g. Project Name or Grant #)</strong></p>\r\n<p>DO: CHHM</p>\r\n<p>DON&rsquo;T: Centre for Hip Health and Mobility</p>\r\n<p>BECAUSE: Short filenames prevent the need for side scrolling and column adjustment.</p>\r\n<p><strong>Include a summary of content (e.g. Questionnaire or GrantProposal) as part of the file name<br /></strong></p>\r\n<p>DO: FileNm_<strong>Guidelines</strong>_20180409_v01.docx</p>\r\n<p>DON&rsquo;T: FileNm_20180409.docx</p>\r\n<p>BECAUSE: Files will be easier to find.</p>\r\n<p><strong>Use _ as delimiters. Avoid these special characters: &amp; , * % # * ( ) ! @$ ^ ~ &lsquo; { } [ ] ? &lt; &gt; &ndash;</strong></p>\r\n<p>DO: FileNm<strong>_</strong>Guidelines<strong>_</strong>20140409<strong>_</strong>v01.docx</p>\r\n<p>DON&rsquo;T: FileNm Guidelines 2014 04 09 v01.docx</p>\r\n<p>BECAUSE: Different computer systems handle&nbsp;special characters differently &ndash; filing order, etc.</p>\r\n<p><strong>Keep track of document versions either sequentially (e.g. v01, v02,) or with a unique date and time ( e.g. 20140403_1800)</strong></p>\r\n<p>DO: FileNm_Guidelines_20140409_<strong>v01</strong>.docx</p>\r\n<p>DON&rsquo;T: FileNm_Guidelines_20140409_<strong>Review</strong>.docx AND FileNm_Guidelines_20140409_<strong>Investigation</strong>.docx</p>\r\n<p>BECAUSE: Two years from now, you won&rsquo;t remember what you meant.</p>\r\n<p><strong>Make folder hierarchies as simple as possible</strong></p>\r\n<p>DO: F:/<strong>&nbsp;Env/LIBR/</strong>DataMgmt_FileFormats_20140409_v01.docx</p>\r\n<p>DON&rsquo;T: F:/<strong>Environment/Library/Woodward/Data/Education/Materials/Draft/2014/04/</strong>-DataMgmt_FileFormats_20140409_v01.docx</p>\r\n<p>BECAUSE: Complex folder hierarchies are harder to navigate and offer more opportunities for filing errors. System back-ups may take longer.</p>","created_at":"2020-07-09 18:04:40 UTC","updated_at":"2020-07-09 18:04:40 UTC","archived":null,"plan_id":9445,"archived_by":null},{"id":2908,"user_id":4897,"question_id":200,"text":"<p>average size of one hour of audio?</p>","created_at":"2020-07-09 18:08:17 UTC","updated_at":"2020-07-15 22:12:11 UTC","archived":1,"plan_id":9445,"archived_by":4897},{"id":2909,"user_id":15612,"question_id":537,"text":"","created_at":"2020-07-14 15:24:43 UTC","updated_at":"2020-07-14 15:24:43 UTC","archived":null,"plan_id":9454,"archived_by":null},{"id":2910,"user_id":4897,"question_id":196,"text":"","created_at":"2020-07-15 21:02:23 UTC","updated_at":"2020-07-15 21:35:33 UTC","archived":1,"plan_id":9445,"archived_by":4897},{"id":2911,"user_id":4897,"question_id":196,"text":"","created_at":"2020-07-15 21:41:59 UTC","updated_at":"2020-07-15 22:19:47 UTC","archived":1,"plan_id":9445,"archived_by":4897},{"id":2912,"user_id":4897,"question_id":210,"text":"","created_at":"2020-07-15 22:09:58 UTC","updated_at":"2020-07-15 22:09:58 UTC","archived":null,"plan_id":9445,"archived_by":null},{"id":2913,"user_id":4897,"question_id":197,"text":"<ul>\r\n<li>Title</li>\r\n<li>Creator: names and addresses of data creator(s)</li>\r\n<li>Identifier: can be a permanent identifier or an internal project number.</li>\r\n<li>Funder</li>\r\n<li>Rights: Intellectual property or licensing rights for the data.</li>\r\n<li>Access Information</li>\r\n<li>Language</li>\r\n<li>Dates</li>\r\n<li>Project description</li>\r\n<li>Methodology: how data was generated.</li>\r\n<li>Data Structure: including relationships between files.</li>\r\n<li>Variable names or other data level documentation (if not self evident or embedded in the file).</li>\r\n<li>Data Citation: Preferred format for citing data.</li>\r\n</ul>\r\n<p>Documentation can be included in a README.txt file (or other relevant file name) in the folder with the data files.The README.txt file should accompany the data if files are moved or deposited in a repository. Be sure the README file includes such information as file folder heirarchy or other external context of the data.</p>\r\n<p>&nbsp;</p>\r\n<p>Tempate 2</p>\r\n<pre class=\"bp-text bp-text-plain hljs bp-is-scrollable\" tabindex=\"0\"><code class=\"bp-text-code txt\">This DATSETNAMEreadme.txt file was generated on YYYY-MM-DD by NAME\r\n&lt;help text is included in angle brackets, and can be deleted before saving&gt;\r\n\r\n\r\nGENERAL INFORMATION\r\n\r\n1. Title of Dataset: \r\n\r\n2. Author Information\r\n\tA. Principal Investigator Contact Information\r\n\t\tName: \r\n\t\tInstitution: \r\n\t\tAddress: \r\n\t\tEmail: \r\n\r\n\tB. Associate or Co-investigator Contact Information\r\n\t\tName: \r\n\t\tInstitution: \r\n\t\tAddress: \r\n\t\tEmail: \r\n\r\n\tC. Alternate Contact Information\r\n\t\tName: \r\n\t\tInstitution: \r\n\t\tAddress: \r\n\t\tEmail: \r\n\r\n3. Date of data collection (single date, range, approximate date) &lt;suggested format YYYY-MM-DD&gt;: \r\n\r\n4. Geographic location of data collection &lt;latitude, longiute, or city/region, State, Country, as appropriate&gt;: \r\n\r\n5. Information about funding sources that supported the collection of the data: \r\n\r\n\r\nSHARING/ACCESS INFORMATION\r\n\r\n1. Licenses/restrictions placed on the data: \r\n\r\n2. Links to publications that cite or use the data: \r\n\r\n3. Links to other publicly accessible locations of the data: \r\n\r\n4. Links/relationships to ancillary data sets: \r\n\r\n5. Was data derived from another source? yes/no\r\n\tA. If yes, list source(s): \r\n\r\n6. Recommended citation for this dataset: \r\n\r\n\r\nDATA &amp; FILE OVERVIEW\r\n\r\n1. File List: \r\n&lt;list all files (or folders, as appropriate for dataset organization) contained in the dataset, with a brief description&gt;\r\n\r\n2. Relationship between files, if important: \r\n\r\n3. Additional related data collected that was not included in the current data package: \r\n\r\n4. Are there multiple versions of the dataset? yes/no\r\n\tA. If yes, name of file(s) that was updated: \r\n\t\ti. Why was the file updated? \r\n\t\tii. When was the file updated? \r\n\r\n\r\nMETHODOLOGICAL INFORMATION\r\n\r\n1. Description of methods used for collection/generation of data: \r\n&lt;Include links or references to publications or other documentation containing experimental design or protocols used in data collection&gt;\r\n\r\n2. Methods for processing the data: \r\n&lt;describe how the submitted data were generated from the raw or collected data&gt;\r\n\r\n3. Instrument- or software-specific information needed to interpret the data: \r\n&lt;include full name and version of software, and any necessary packages or libraries needed to run scripts&gt;\r\n\r\n4. Standards and calibration information, if appropriate: \r\n\r\n5. Environmental/experimental conditions: \r\n\r\n6. Describe any quality-assurance procedures performed on the data: \r\n\r\n7. People involved with sample collection, processing, analysis and/or submission: \r\n\r\n\r\nDATA-SPECIFIC INFORMATION FOR: [FILENAME]\r\n&lt;repeat this section for each dataset, folder or file, as appropriate&gt;\r\n\r\n1. Number of variables: \r\n\r\n2. Number of cases/rows: \r\n\r\n3. Variable List: \r\n&lt;list variable name(s), description(s), unit(s)and value labels as appropriate for each&gt;\r\n\r\n4. Missing data codes: \r\n&lt;list code/symbol and definition&gt;n\r\n\r\n5. Specialized formats or other abbreviations used: </code></pre>","created_at":"2020-07-15 22:15:50 UTC","updated_at":"2020-07-15 22:18:47 UTC","archived":null,"plan_id":9445,"archived_by":null},{"id":2914,"user_id":15747,"question_id":260,"text":"","created_at":"2020-07-18 19:57:47 UTC","updated_at":"2020-07-18 19:57:47 UTC","archived":null,"plan_id":9466,"archived