":18741,"question_id":196,"text":"","created_at":"2020-12-07 13:29:29 UTC","updated_at":"2020-12-07 13:29:29 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3190,"user_id":18741,"question_id":194,"text":"<p>Deb are we storing interview/focus group data here?</p>","created_at":"2020-12-07 13:29:42 UTC","updated_at":"2020-12-07 13:29:42 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3191,"user_id":18741,"question_id":195,"text":"<p>Ideally, probably .csv or xls files?</p>","created_at":"2020-12-07 13:34:37 UTC","updated_at":"2020-12-07 13:34:37 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3192,"user_id":18741,"question_id":196,"text":"","created_at":"2020-12-07 13:40:21 UTC","updated_at":"2020-12-07 13:40:21 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3193,"user_id":18741,"question_id":196,"text":"","created_at":"2020-12-07 13:45:25 UTC","updated_at":"2020-12-07 13:45:25 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3194,"user_id":18741,"question_id":197,"text":"<p>Deb will any of the final spreadsheets used to make the visualizations (Nodes and Edges sheets) be uploaded to the repository?</p>","created_at":"2020-12-07 13:47:33 UTC","updated_at":"2020-12-07 13:47:33 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3195,"user_id":18741,"question_id":198,"text":"<p>Deb do you have any preferences surrounding how we document?</p>","created_at":"2020-12-07 13:53:33 UTC","updated_at":"2020-12-07 13:53:33 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3196,"user_id":18741,"question_id":199,"text":"<p>Deb do you favour a particular metadata standard?</p>","created_at":"2020-12-07 13:54:41 UTC","updated_at":"2020-12-07 13:54:41 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3197,"user_id":18741,"question_id":200,"text":"<p>Am I wrong in assuming that we wouldn't need more than 10GB for a project like this?</p>","created_at":"2020-12-07 13:55:47 UTC","updated_at":"2020-12-07 13:55:47 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3198,"user_id":18741,"question_id":201,"text":"<p>Deb, how do you usually go about backing-up project data when you're working?</p>","created_at":"2020-12-07 13:57:21 UTC","updated_at":"2020-12-07 13:57:21 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3199,"user_id":18741,"question_id":203,"text":"<p>Deakin is more of a question of what goes where. Are we storing Work Package 1 data there as a back-up and are we storing Work Package 2 data at the UofA?</p>","created_at":"2020-12-07 14:01:10 UTC","updated_at":"2020-12-07 14:01:10 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3200,"user_id":18741,"question_id":202,"text":"<p>Good question. Are we going to be working in and out of Dataverse, or will we just be uploading data to it and then working with it on our own machines or sharing through Dropbox?</p>","created_at":"2020-12-07 14:02:52 UTC","updated_at":"2020-12-07 14:02:52 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3201,"user_id":18741,"question_id":204,"text":"<p>Not sure about the final file format or whether we will be removing non-anonymized datasets from earlier in the work from the repository.&nbsp;</p>","created_at":"2020-12-07 14:08:06 UTC","updated_at":"2020-12-07 14:08:06 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3202,"user_id":18741,"question_id":205,"text":"<p>Other than the file format, I think this is accurate.&nbsp;</p>","created_at":"2020-12-07 14:10:14 UTC","updated_at":"2020-12-07 14:10:14 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3203,"user_id":18741,"question_id":206,"text":"<p>Deb, do you have any thoughts on this?</p>","created_at":"2020-12-07 14:10:54 UTC","updated_at":"2020-12-07 14:10:54 UTC","archived":null,"plan_id":10095,"archived_by":null},{"id":3204,"user_id":18741,"question_id":207,"text":"<p>Do you have any thoughts on this Deb?</p>","crea